-- 导出  过程 sse.exam_statistic_score 结构
DROP PROCEDURE IF EXISTS `exam_statistic_score`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `exam_statistic_score`(IN _year VARCHAR(30),IN _collegeId VARCHAR(30))
BEGIN
	    DECLARE i_type INT;
	    DECLARE v_area VARCHAR(30);
	    
	    SELECT TYPE,AREA INTO i_type,v_area FROM college_info WHERE id = _collegeId;
	    
	    IF i_type=0 THEN/*主考*/
			SELECT t.college_id,t.college_name,t.profession_id,t.profession_name,
			  COUNT(DISTINCT t.student_id_pass) as student_pass,COUNT(t.student_id_pass) as subject_pass,
			  COUNT(DISTINCT t.student_id_no_pass) as student_no_pass,COUNT(t.student_id_no_pass) as subject_no_pass
			FROM
			  (SELECT
			     a.college_code                AS college_id,
			     a.college_name                AS college_name,
			     a.profession_code                     AS profession_id,
			     a.profession_name                     AS profession_name,
			     IF(a.score >= 60, a.student_id, NULL) AS student_id_pass,
			     IF(a.score < 60, a.student_id, NULL)  AS student_id_no_pass
			   FROM exam_place_arrange a
			   WHERE a.primary_college_code=_collegeId AND a.study_year=_year AND a.report_state=1) t
			GROUP BY t.college_id,t.profession_id,t.college_name,t.profession_name;
			
	    ELSEIF i_type=1 THEN/*专科*/
	    		SELECT t.college_id,t.college_name,t.profession_id,t.profession_name,
			  COUNT(DISTINCT t.student_id_pass) AS student_pass,COUNT(t.student_id_pass) AS subject_pass,
			  COUNT(DISTINCT t.student_id_no_pass) AS student_no_pass,COUNT(t.student_id_no_pass) AS subject_no_pass
			FROM
			  (SELECT
			     a.primary_college_code                AS college_id,
			     a.primary_college_name                AS college_name,
			     a.profession_code                     AS profession_id,
			     a.profession_name                     AS profession_name,
			     IF(a.score >= 60, a.student_id, NULL) AS student_id_pass,
			     IF(a.score < 60, a.student_id, NULL)  AS student_id_no_pass
			   FROM exam_place_arrange a
			   WHERE a.college_code=_collegeId AND a.study_year=_year AND a.report_state=1) t
			GROUP BY t.college_id,t.profession_id,t.college_name,t.profession_name;
		
	    ELSEIF i_type=2 THEN/*省自考办*/
			SELECT t.college_id,t.college_name,t.profession_id,t.profession_name,
			  COUNT(DISTINCT t.student_id_pass) AS student_pass,COUNT(t.student_id_pass) AS subject_pass,
			  COUNT(DISTINCT t.student_id_no_pass) AS student_no_pass,COUNT(t.student_id_no_pass) AS subject_no_pass
			FROM
			  (SELECT
			     a.primary_college_code                AS college_id,
			     a.primary_college_name                AS college_name,
			     a.profession_code                     AS profession_id,
			     a.profession_name                     AS profession_name,
			     IF(a.score >= 60, a.student_id, NULL) AS student_id_pass,
			     IF(a.score < 60, a.student_id, NULL)  AS student_id_no_pass
			   FROM exam_place_arrange a
			   WHERE a.study_year=_year AND a.report_state=1) t
			GROUP BY t.college_id,t.profession_id,t.college_name,t.profession_name;
			
	    ELSEIF i_type=3 THEN/*市自考办*/
			SELECT t.college_id,t.college_name,t.profession_id,t.profession_name,
			  COUNT(DISTINCT t.student_id_pass) AS student_pass,COUNT(t.student_id_pass) AS subject_pass,
			  COUNT(DISTINCT t.student_id_no_pass) AS student_no_pass,COUNT(t.student_id_no_pass) AS subject_no_pass
			FROM
			  (SELECT
			     a.primary_college_code                AS college_id,
			     a.primary_college_name                AS college_name,
			     a.profession_code                     AS profession_id,
			     a.profession_name                     AS profession_name,
			     IF(a.score >= 60, a.student_id, NULL) AS student_id_pass,
			     IF(a.score < 60, a.student_id, NULL)  AS student_id_no_pass
			   FROM exam_place_arrange a
			   WHERE a.study_year=_year AND a.report_state=1 and a.college_code in (SELECT id FROM college_info WHERE TYPE=1 AND state=1 AND AREA=v_area)) t
			GROUP BY t.college_id,t.profession_id,t.college_name,t.profession_name;
			
	    ELSE
		SELECT '' AS college_id,'' AS college_name, '' AS profession_id, '' AS profession_name, 0 AS  student_pass,0 AS subject_pass,0 as student_no_pass,0 as subject_no_pass  FROM student WHERE 0=1;
	    END IF;
    END//
DELIMITER ;

-- 导出  过程 sse.exam_statistic_student 结构
DROP PROCEDURE IF EXISTS `exam_statistic_student`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `exam_statistic_student`(IN _year VARCHAR(30),IN _collegeId VARCHAR(30))
BEGIN
	    DECLARE i_type INT;
	    DECLARE v_area VARCHAR(30);
	    
	    SELECT TYPE,AREA INTO i_type,v_area FROM college_info WHERE id = _collegeId;
	    
	    IF i_type=0 THEN/*主考*/
			SELECT
			  a.college_code       AS college_id,
			  a.college_name       AS college_name,
			  a.profession_code            AS profession_id,
			  a.profession_name            AS profession_name,
			  COUNT(DISTINCT a.student_id) AS student_count,
			  COUNT(a.student_id)          AS subject_count
			FROM exam_place_arrange a
			WHERE a.primary_college_code=_collegeId AND a.study_year=_year and a.report_state IS NOT NULL
			GROUP BY a.college_code, a.profession_code, a.college_name, a.profession_name;
			
	    ELSEIF i_type=1 THEN/*专科*/
	    		SELECT
			  a.primary_college_code       AS college_id,
			  a.primary_college_name       AS college_name,
			  a.profession_code            AS profession_id,
			  a.profession_name            AS profession_name,
			  count(DISTINCT a.student_id) AS student_count,
			  count(a.student_id)          AS subject_count
			FROM exam_place_arrange a
			WHERE a.college_code=_collegeId AND a.study_year=_year AND a.report_state is not null
			GROUP BY a.primary_college_code, a.profession_code, a.primary_college_name, a.profession_name;
		
	    ELSEIF i_type=2 THEN/*省自考办*/
			SELECT
			  a.primary_college_code       AS college_id,
			  a.primary_college_name       AS college_name,
			  a.profession_code            AS profession_id,
			  a.profession_name            AS profession_name,
			  COUNT(DISTINCT a.student_id) AS student_count,
			  COUNT(a.student_id)          AS subject_count
			FROM exam_place_arrange a
			WHERE a.study_year=_year AND a.report_state IS NOT NULL
			GROUP BY a.primary_college_code, a.profession_code, a.primary_college_name, a.profession_name;
			
	    ELSEIF i_type=3 THEN/*市自考办*/
			SELECT
			  a.primary_college_code       AS college_id,
			  a.primary_college_name       AS college_name,
			  a.profession_code            AS profession_id,
			  a.profession_name            AS profession_name,
			  COUNT(DISTINCT a.student_id) AS student_count,
			  COUNT(a.student_id)          AS subject_count
			FROM exam_place_arrange a 
			WHERE a.study_year=_year AND a.report_state IS NOT NULL and a.college_code in (SELECT id FROM college_info WHERE TYPE=1 AND state=1 AND AREA=v_area)
			GROUP BY a.primary_college_code, a.profession_code, a.primary_college_name, a.profession_name;
			
	    ELSE
		SELECT '' AS college_id,'' AS college_name, '' as profession_id, '' as profession_name, 0 AS  student_count,0 AS subject_count  FROM student WHERE 0=1;
	    END IF;
    END//
DELIMITER ;

-- 导出  过程 sse.graduate2score 结构
DROP PROCEDURE IF EXISTS `graduate2score`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `graduate2score`(IN _studentId varchar(30))
BEGIN
	/**
	从毕业库  转入  在籍库
	*/
	
	
	DELETE FROM student_graduate_score_year WHERE score_id IN(SELECT id FROM student_graduate_score WHERE student_id=_studentId);
	
	DELETE FROM student_graduate_score WHERE student_id=_studentId;
	
	update student set is_return_graduate=true where id=_studentId;
	
	DELETE FROM student_graduate WHERE  id=_studentId;
		
    END//
DELIMITER ;

