-- 导出  过程 sse.score2graduate 结构
DROP PROCEDURE IF EXISTS `score2graduate`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `score2graduate`(IN _studentId varchar(30))
BEGIN
	/**
	从在籍库  转入  毕业库
	*/
	
		
	
	DELETE FROM student_score_year WHERE score_id IN(SELECT id FROM student_score WHERE student_id=_studentId);
	
	DELETE FROM student_score WHERE student_id=_studentId;
	
	
	   
	DELETE FROM student WHERE  id=_studentId;
   
		
    END//
DELIMITER ;

