-- 导出  过程 sse.sp_master_college 结构
DROP PROCEDURE IF EXISTS `sp_master_college`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `sp_master_college`(in collegeId varchar(30))
BEGIN
	    DECLARE i_type int;
	    declare v_area varchar(30);
	    
	    select type,area into i_type,v_area from college_info where id = collegeId;
	    
	    if i_type=0 then/*主考*/
		select id,name from college_info where type=0 and state=1 and id = collegeId;
	    elseif i_type=1 then/*专科*/
		SELECT id,NAME FROM college_info WHERE TYPE=0 and state=1 AND id in(SELECT master_college_id FROM college_relation WHERE slave_college_id  = collegeId);
	    elseIF i_type=2 THEN/*省自考办*/
		SELECT id,NAME FROM college_info  WHERE TYPE=0 and state=1;
	    elseIF i_type=3 THEN/*市自考办*/
		SELECT id,NAME FROM college_info where TYPE=0 and state=1 AND AREA=v_area;
	    else
		select id,name from college_info where 0=1;
	    end if;
    END//
DELIMITER ;

-- 导出  过程 sse.sp_profession 结构
DROP PROCEDURE IF EXISTS `sp_profession`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `sp_profession`(in collegeId varchar(30))
BEGIN
	    DECLARE i_type int;
	    declare v_area varchar(30);
	    
	    select type,area into i_type,v_area from college_info where id = collegeId;
	    
	    if i_type=0 then/*主考*/
		SELECT id,concat(id,'-',name) as name FROM profession WHERE primary_college = collegeId order by name;		
	    elseif i_type=1 then/*专科*/		
		SELECT id,CONCAT(id,'-',NAME) AS NAME FROM profession WHERE id IN (SELECT profession_id FROM college_relation WHERE  slave_college_id = collegeId)  ORDER BY NAME;
	    elseIF i_type=2 THEN/*省自考办*/
		SELECT id,CONCAT(id,'-',NAME) AS NAME FROM profession ;
	    elseIF i_type=3 THEN/*市自考办*/
		select distinct b.id,CONCAT(b.id,'-',b.NAME) AS NAME from (
		SELECT id,NAME FROM profession WHERE primary_college in(SELECT id FROM college_info WHERE TYPE IN(0,1) AND state=1 AND AREA=v_area)
		union all
		SELECT id,name FROM profession WHERE id IN (SELECT profession_id FROM college_relation WHERE  slave_college_id in(SELECT id FROM college_info WHERE TYPE IN(0,1) AND state=1 AND AREA=v_area))
		) b  ORDER BY NAME;	
	    else
		select id,name from profession where 1=0;
	    end if;
    END//
DELIMITER ;

-- 导出  过程 sse.sp_slave_college 结构
DROP PROCEDURE IF EXISTS `sp_slave_college`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `sp_slave_college`(in collegeId varchar(30))
BEGIN
	    DECLARE i_type int;
	    declare v_area varchar(30);
	    
	    select type,area into i_type,v_area from college_info where id = collegeId;
	    
	    if i_type=0 then/*主考*/
		SELECT id,NAME FROM college_info WHERE TYPE=1 AND state=1 AND id IN(SELECT slave_college_id FROM college_relation WHERE master_college_id = collegeId);		
	    elseif i_type=1 then/*专科*/
		SELECT id,NAME FROM college_info WHERE TYPE=1 AND state=1 AND id = collegeId;
	    elseIF i_type=2 THEN/*省自考办*/
		SELECT id,NAME FROM college_info  WHERE TYPE=1 and state=1;
	    elseIF i_type=3 THEN/*市自考办*/
		SELECT id,NAME FROM college_info where TYPE=1 and state=1 AND AREA=v_area;	
	    else
		SELECT id,NAME FROM college_info WHERE 0=1;
	    end if;
    END//
DELIMITER ;

-- 导出  过程 sse.sp_statistic_examcode 结构
DROP PROCEDURE IF EXISTS `sp_statistic_examcode`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `sp_statistic_examcode`(in _year varchar(30),in _collegeId varchar(30))
BEGIN
	    DECLARE i_type int;
	    declare v_area varchar(30);
	    
	    select type,area into i_type,v_area from college_info where id = _collegeId;
	    
	    if i_type=0 then/*主考*/
			SELECT   college_code,profession_code,MAX(college_name) AS college_name,MAX(profession_name) AS profession_name,SUM(a001) AS uncheck,SUM(a002)AS success,SUM(a003)AS  failure FROM (
			    SELECT college_code,profession_code,MAX(college_name) AS college_name ,MAX(profession_name) AS profession_name,COUNT(*) AS a001,0 AS a002,0 AS a003 FROM student WHERE primary_college_code=_collegeId AND study_year=_year AND state=0
			       GROUP BY college_code,profession_code
			    UNION ALL
				SELECT college_code,profession_code,MAX(college_name) AS college_name ,MAX(profession_name) AS profession_name,0 AS a001,COUNT(*)AS a002,0 AS a003 FROM student WHERE  primary_college_code=_collegeId AND study_year=_year AND state=1
			       GROUP BY college_code,profession_code
			    UNION ALL
				SELECT college_code,profession_code,MAX(college_name) AS college_name ,MAX(profession_name) AS profession_name,0 AS a001,0 AS a002,COUNT(*) AS a003 FROM student WHERE  primary_college_code=_collegeId AND study_year=_year AND state=2
			       GROUP BY college_code,profession_code
		   ) t1 GROUP BY college_code,profession_code;
					
	    elseif i_type=1 then/*专科*/
	    
		SELECT   primary_college_code as college_code,profession_code,MAX(college_name) AS college_name,MAX(profession_name) AS profession_name,SUM(a001) AS uncheck,SUM(a002)AS success,SUM(a003)AS  failure FROM (
			    SELECT primary_college_code,profession_code,MAX(primary_college_name) AS college_name ,MAX(profession_name) AS profession_name,COUNT(*) AS a001,0 AS a002,0 AS a003 FROM student WHERE college_code=_collegeId AND study_year=_year AND state=0
			       GROUP BY primary_college_code,profession_code
			    UNION ALL
				SELECT primary_college_code,profession_code,MAX(primary_college_name) AS college_name ,MAX(profession_name) AS profession_name,0 AS a001,COUNT(*)AS a002,0 AS a003 FROM student WHERE  college_code=_collegeId AND study_year=_year AND state=1
			       GROUP BY primary_college_code,profession_code
			    UNION ALL
				SELECT primary_college_code,profession_code,MAX(primary_college_name) AS college_name ,MAX(profession_name) AS profession_name,0 AS a001,0 AS a002,COUNT(*) AS a003 FROM student WHERE  college_code=_collegeId AND study_year=_year AND state=2
			       GROUP BY primary_college_code,profession_code
		   ) t1 GROUP BY primary_college_code,profession_code;
		   	
	    elseIF i_type=2 THEN/*省自考办*/
			
		SELECT   primary_college_code AS college_code,profession_code,MAX(college_name) AS college_name,MAX(profession_name) AS profession_name,SUM(a001) AS uncheck,SUM(a002)AS success,SUM(a003)AS  failure FROM (
			    SELECT primary_college_code,profession_code,MAX(primary_college_name) AS college_name ,MAX(profession_name) AS profession_name,COUNT(*) AS a001,0 AS a002,0 AS a003 FROM student WHERE  study_year=_year AND state=0
			       GROUP BY primary_college_code,profession_code
			    UNION ALL
				SELECT primary_college_code,profession_code,MAX(primary_college_name) AS college_name ,MAX(profession_name) AS profession_name,0 AS a001,COUNT(*)AS a002,0 AS a003 FROM student WHERE   study_year=_year AND state=1
			       GROUP BY primary_college_code,profession_code
			    UNION ALL
				SELECT primary_college_code,profession_code,MAX(primary_college_name) AS college_name ,MAX(profession_name) AS profession_name,0 AS a001,0 AS a002,COUNT(*) AS a003 FROM student WHERE   study_year=_year AND state=2
			       GROUP BY primary_college_code,profession_code
		   ) t1 GROUP BY primary_college_code,profession_code;
	    elseIF i_type=3 THEN/*市自考办*/
			
		SELECT '' AS college_name,'' AS profession_name, 0 AS  uncheck,0 AS success,0 AS failure  FROM student WHERE 0=1;
			
	    else
		SELECT '' as college_name,'' as profession_name, 0 as  uncheck,0 AS success,0 as failure  from student where 0=1;
	    end if;
    END//
DELIMITER ;

-- 导出  过程 sse.sp_statistic_examcode_detail 结构
DROP PROCEDURE IF EXISTS `sp_statistic_examcode_detail`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `sp_statistic_examcode_detail`(in _year varchar(30),in _collegeId varchar(30),IN _collegeId_2 VARCHAR(30),IN _profession varchar(30),in _state int)
BEGIN
	    DECLARE i_type int;
	    declare v_area varchar(30);
	    
	    select type,area into i_type,v_area from college_info where id = _collegeId;
	    
	    if i_type=0 then/*主考*/
			
			SELECT college_name AS college_name,
			    profession_name,id_code,NAME,	CASE  gender WHEN 1 THEN '女' WHEN  0 THEN '男' ELSE '其他' END AS gender 
			    ,temp_exam_code,exam_code,remark FROM student WHERE primary_college_code=_collegeId AND college_code=_collegeId_2 AND profession_code=_profession AND study_year=_year AND state=_state	;	
	    elseif i_type=1 then/*专科*/
	    
			SELECT primary_college_name AS college_name,
			    profession_name,id_code,NAME,	CASE  gender WHEN 1 THEN '女' WHEN  0 THEN '男' ELSE '其他' END AS gender 
			    ,temp_exam_code,exam_code,remark FROM student WHERE college_code=_collegeId and primary_college_code=_collegeId_2 AND profession_code=_profession  AND study_year=_year AND state=_state	;	
	    
	    end if;
    END//
DELIMITER ;

-- 导出  过程 sse.sp_statistic_graduate 结构
DROP PROCEDURE IF EXISTS `sp_statistic_graduate`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `sp_statistic_graduate`(in _year varchar(30),in _collegeId varchar(30))
BEGIN
	    DECLARE i_type int;
	    declare v_area varchar(30);
	    
	    select type,area into i_type,v_area from college_info where id = _collegeId;
	    
	    if i_type=0 then/*主考*/
			SELECT _collegeId AS masterid,college_code AS slaveid,profession_code,MAX(primary_college_name) primary_name,MAX(profession_name) AS profession_name,
			SUM(IF(graduate_state=1,1,0)) AS graduate_person,SUM(IF(graduate_state=2,1,0)) AS stop_person
			 FROM student_graduate WHERE primary_college_code=_collegeId and study_year=_year  GROUP BY college_code,profession_code;
			
	    elseif i_type=1 then/*专科*/
	    
			SELECT primary_college_code AS masterid,_collegeId AS slaveid,profession_code,MAX(primary_college_name) primary_name,MAX(profession_name) AS profession_name,
			SUM(IF(graduate_state=1,1,0)) AS graduate_person,SUM(IF(graduate_state=2,1,0)) AS stop_person
			 FROM student_graduate WHERE college_code=_collegeId AND study_year=_year  GROUP BY primary_college_code,profession_code;
		
	    elseIF i_type=2 THEN/*省自考办*/
			SELECT primary_college_code AS masterid,college_code AS slaveid,profession_code,MAX(primary_college_name) primary_name,MAX(profession_name) AS profession_name,
			SUM(IF(graduate_state=1,1,0)) AS graduate_person,SUM(IF(graduate_state=2,1,0)) AS stop_person
			 FROM student_graduate WHERE study_year=_year  GROUP BY primary_college_code,college_code,profession_code;
			
	    elseIF i_type=3 THEN/*市自考办*/
		SELECT primary_college_code AS masterid,college_code AS slaveid,profession_code,MAX(primary_college_name) primary_name,MAX(profession_name) AS profession_name,
			SUM(IF(graduate_state=1,1,0)) AS graduate_person,SUM(IF(graduate_state=2,1,0)) AS stop_person
			 FROM student_graduate WHERE study_year=_year AND college_code IN(SELECT id FROM college_info WHERE TYPE=1 AND state=1 AND AREA=v_area)  
			   GROUP BY primary_college_code,college_code,profession_code;
			 	  
	    end if;
    END//
DELIMITER ;

-- 导出  过程 sse.sp_statistic_home 结构
DROP PROCEDURE IF EXISTS `sp_statistic_home`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `sp_statistic_home`(in _year varchar(30),in _collegeId varchar(30))
BEGIN
	    DECLARE i_type int;
	    declare v_area varchar(30);
	    DECLARE i_val_1 int default 0;
	    DECLARE i_val_2 INT DEFAULT 0;
	    DECLARE i_val_3 INT DEFAULT 0;
	    DECLARE i_val_4 INT DEFAULT 0;
	    	    
	    
	    select type,area into i_type,v_area from college_info where id = _collegeId;
	    
		
	    
	    if i_type=0 then/*主考*/
			/*1、统计新生报名*/
			SELECT SUM(a.cnt) INTO i_val_1 FROM(
				SELECT COUNT(*) AS cnt FROM student WHERE primary_college_code=_collegeId  AND study_year=_year
				UNION ALL
				SELECT COUNT(*)  FROM student_signup WHERE  primary_college_code=_collegeId  AND study_year=_year and delete_state=false
			) a ;
			/*2、统计免考上报*/
			SELECT COUNT(*) INTO i_val_2 FROM void_score_report WHERE  primary_college_code=_collegeId  AND study_year=_year ;			
			/*3、统计助学报考*/
			SELECT COUNT(*) INTO i_val_3 FROM exam_place_arrange WHERE  primary_college_code=_collegeId  AND study_year=_year  AND report_state IS NOT NULL;				
			/*4、统计毕业停考*/
			SELECT COUNT(*) INTO i_val_4 FROM student_graduate WHERE  primary_college_code=_collegeId  AND graduate_year=_year ;
			
					
	    elseif i_type=1 then/*专科*/
	    
			/*1、统计新生报名*/
			SELECT SUM(a.cnt) INTO i_val_1 FROM(
				SELECT COUNT(*) AS cnt FROM student WHERE college_code=_collegeId  AND study_year=_year
				UNION ALL
				SELECT COUNT(*)  FROM student_signup WHERE  college_code=_collegeId  AND study_year=_year and delete_state=false
			) a ;
			/*2、统计免考上报*/
			SELECT COUNT(*) INTO i_val_2 FROM void_score_report WHERE  college_code=_collegeId  AND study_year=_year ;			
			/*3、统计助学报考*/
			SELECT COUNT(*) INTO i_val_3 FROM exam_place_arrange WHERE  college_code=_collegeId  AND study_year=_year AND report_state IS NOT NULL;				
			/*4、统计毕业停考*/
			SELECT COUNT(*) INTO i_val_4 FROM student_graduate WHERE  college_code=_collegeId  AND graduate_year=_year ;
		   	
	    elseIF i_type=2 THEN/*省自考办*/
			/*1、统计新生报名*/
			SELECT SUM(a.cnt) INTO i_val_1 FROM(
				SELECT COUNT(*) AS cnt FROM student WHERE  study_year=_year
				UNION ALL
				SELECT COUNT(*)  FROM student_signup WHERE   study_year=_year and delete_state=false
			) a ;
			/*2、统计免考上报*/
			SELECT COUNT(*) INTO i_val_2 FROM void_score_report WHERE   study_year=_year ;			
			/*3、统计助学报考*/
			SELECT COUNT(*) INTO i_val_3 FROM exam_place_arrange WHERE   study_year=_year AND report_state IS NOT NULL;				
			/*4、统计毕业停考*/
			SELECT COUNT(*) INTO i_val_4 FROM student_graduate WHERE   graduate_year=_year ;
		
	    elseIF i_type=3 THEN/*市自考办*/
	    			
			/*1、统计新生报名*/
			SELECT SUM(a.cnt) INTO i_val_1 FROM(
				SELECT COUNT(*) AS cnt FROM student WHERE college_code IN(SELECT id FROM college_info WHERE TYPE=1 AND state=1 AND AREA=v_area)   AND study_year=_year
				UNION ALL
				SELECT COUNT(*)  FROM student_signup WHERE  college_code IN(SELECT id FROM college_info WHERE TYPE=1 AND state=1 AND AREA=v_area)   AND study_year=_year and delete_state=false 
			) a ;
			/*2、统计免考上报*/
			SELECT COUNT(*) INTO i_val_2 FROM void_score_report WHERE  college_code IN(SELECT id FROM college_info WHERE TYPE=1 AND state=1 AND AREA=v_area)   AND study_year=_year ;			
			/*3、统计助学报考*/
			SELECT COUNT(*) INTO i_val_3 FROM exam_place_arrange WHERE  college_code IN(SELECT id FROM college_info WHERE TYPE=1 AND state=1 AND AREA=v_area)   AND study_year=_year AND report_state IS NOT NULL;				
			/*4、统计毕业停考*/
			SELECT COUNT(*) INTO i_val_4 FROM student_graduate WHERE  college_code IN(SELECT id FROM college_info WHERE TYPE=1 AND state=1 AND AREA=v_area)  AND graduate_year=_year ;
			
	    end if;
	    
	    select i_val_1,i_val_2,i_val_3,i_val_4 ;
    END//
DELIMITER ;

-- 导出  过程 sse.sp_statistic_nopaid 结构
DROP PROCEDURE IF EXISTS `sp_statistic_nopaid`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `sp_statistic_nopaid`(in _year varchar(30),in _collegeId varchar(30))
BEGIN
	    DECLARE i_type int;
	    declare v_area varchar(30);
	    
	    select type,area into i_type,v_area from college_info where id = _collegeId;
	    
	    if i_type=0 then/*主考*/
		SELECT  _collegeId as masterid,college_code  AS slaveid,profession_code,
		MAX(college_name) AS primary_name,MAX(profession_name) AS profession_name,
		 SUM(IF(is_paid>0,1,0)) AS paid,SUM(IF(is_paid>0,0,1)) AS nopaid
		FROM student WHERE primary_college_code=_collegeId and study_year=_year  
		GROUP BY college_code,profession_code;
				
				
				
	    elseif i_type=1 then/*专科*/
	    
		SELECT  primary_college_code AS masterid,_collegeId AS slaveid,college_code  AS slaveid,profession_code,
		MAX(college_name) AS primary_name,MAX(profession_name) AS profession_name,
		 SUM(IF(is_paid>0,1,0)) AS paid,SUM(IF(is_paid>0,0,1)) AS nopaid
		FROM student WHERE college_code=_collegeId AND study_year=_year  
		GROUP BY primary_college_code,profession_code;
	    
		
	    elseIF i_type=2 THEN/*省自考办*/
	    
		SELECT  primary_college_code AS masterid,college_code AS slaveid,college_code  AS slaveid,profession_code,
		MAX(college_name) AS primary_name,MAX(profession_name) AS profession_name,
		 SUM(IF(is_paid>0,1,0)) AS paid,SUM(IF(is_paid>0,0,1)) AS nopaid
		FROM student WHERE  study_year=_year  
		GROUP BY primary_college_code,college_code,profession_code;
		
			
	    elseIF i_type=3 THEN/*市自考办*/
		SELECT  primary_college_code AS masterid,college_code AS slaveid,college_code  AS slaveid,profession_code,
		MAX(college_name) AS primary_name,MAX(profession_name) AS profession_name,
		 SUM(IF(is_paid>0,1,0)) AS paid,SUM(IF(is_paid>0,0,1)) AS nopaid
		FROM student WHERE  study_year=_year   AND college_code IN(SELECT id FROM college_info WHERE TYPE=1 AND state=1 AND AREA=v_area)
		GROUP BY primary_college_code,college_code,profession_code;
		
		
			
	  
	    end if;
    END//
DELIMITER ;

-- 导出  过程 sse.sp_statistic_score 结构
DROP PROCEDURE IF EXISTS `sp_statistic_score`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `sp_statistic_score`(in _class varchar(30),in _collegeId varchar(30))
BEGIN
	    DECLARE i_type int;
	    declare v_area varchar(30);
	    
	    select type,area into i_type,v_area from college_info where id = _collegeId;
	    
