-- 导出  过程 sse.sp_statistic_void_detail 结构
DROP PROCEDURE IF EXISTS `sp_statistic_void_detail`;
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `sp_statistic_void_detail`(in _year varchar(30),in _collegeId varchar(30),IN _collegeId_2 VARCHAR(30),IN _profession varchar(30))
BEGIN
	    DECLARE i_type int;
	    declare v_area varchar(30);
	    
	    select type,area into i_type,v_area from college_info where id = _collegeId;
	    
	    if i_type=0 then/*主考*/
			
			SELECT college_code as college_code,profession_code,college_name AS college_name,profession_name,
				NAME,CASE  gender WHEN 1 THEN '女' WHEN  0 THEN '男' ELSE '其他' END AS gender ,
				CASE  exam_code WHEN '' THEN temp_exam_code ELSE exam_code  END AS examcode,
			    void_pass,void_no_pass 
			    FROM student 
			    WHERE primary_college_code=_collegeId and college_code like concat(_collegeId_2,'%') AND profession_code  LIKE CONCAT(_profession,'%') AND study_year=_year  AND (void_pass>0 OR void_no_pass>0);	
	    elseif i_type=1 then/*专科*/
	    
			SELECT primary_college_code AS college_code,profession_code,primary_college_name AS college_name,profession_name,
				NAME,CASE  gender WHEN 1 THEN '女' WHEN  0 THEN '男' ELSE '其他' END AS gender ,
				CASE  exam_code WHEN '' THEN temp_exam_code ELSE exam_code  END AS examcode,
			    void_pass,void_no_pass 
			    FROM student WHERE college_code=_collegeId AND primary_college_code like concat(_collegeId_2,'%') AND profession_code LIKE CONCAT(_profession,'%') AND study_year=_year  AND (void_pass>0 OR void_no_pass>0);	
	    ELSEIF i_type=2 THEN/*自考办*/
			SELECT primary_college_code AS college_code,profession_code,primary_college_name AS college_name,profession_name,
				NAME,CASE  gender WHEN 1 THEN '女' WHEN  0 THEN '男' ELSE '其他' END AS gender ,
				CASE  exam_code WHEN '' THEN temp_exam_code ELSE exam_code  END AS examcode,
			    void_pass,void_no_pass 
			    FROM student WHERE primary_college_code like concat(_collegeId_2,'%') and  profession_code like concat(_profession,'%') AND study_year=_year and (void_pass>0 or void_no_pass>0);
	    end if;
    END//
DELIMITER ;

