	('000184', '第二节 明确爱国主义的时代要求', 'http://room.jxjycn.cn/courseware/619/201301/ab01e0fff98cefec6a94f7a785e7ccfb.flv', 2, NULL, '<p><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">1、新时期爱国主义的主题</span></p>\r\n<p><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">2、新时期爱国主义的基本特征</span><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'"><?xml:namespace prefix="o" ns="urn:schemas-microsoft-com:office:office"?><o:p></o:p></span></p>\r\n<p><!--EndFragment--></p>', NULL, '32680', '03706', NULL, '2016-09-14 17:29:03', '2017-11-16 16:21:52'),
	('000185', '第三节 做新时期忠诚坚定的爱国者', 'http://room.jxjycn.cn/courseware/619/201306/074f0e787abfea5b53d602c1cf999dcf.flv', 2, NULL, '<p>&nbsp;</p>\r\n<p style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" class="p0"><span style="FONT-FAMILY: \'宋体\'; BACKGROUND: rgb(255,255,255); FONT-SIZE: 9pt; mso-spacerun: \'yes\'; mso-shading: rgb(255,255,255)">1、</span><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">爱国主义的第四、五个基本特征：爱国主义与弘扬民族精神的统一、爱国主义与弘扬时代精神的统一</span><span style="FONT-FAMILY: \'Calibri\'; FONT-SIZE: 10.5pt; mso-spacerun: \'yes\'"><?xml:namespace prefix="o" ns="urn:schemas-microsoft-com:office:office"?><o:p></o:p></span></p>\r\n<p style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" class="p0"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">2、培育爱国情感，保持民族自尊和自信</span><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 9pt; mso-spacerun: \'yes\'"><o:p></o:p></span></p>\r\n<p style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" class="p0"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">3、维护民族团结，促进祖国统一</span><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 9pt; mso-spacerun: \'yes\'"><o:p></o:p></span></p>\r\n<p style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" class="p0"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">4、努力学习和工作，以实际行动和贡献履行爱国义务</span></p>\r\n<p><!--EndFragment--></p>', NULL, '32681', '03706', NULL, '2016-09-14 17:29:04', '2017-11-16 16:21:52'),
	('000186', '第一节 追求高尚的人生目的', 'http://room.jxjycn.cn/courseware/619/201301/33dcee828579cdbd73b4127ba69fbbdd.flv', 2, NULL, '<p>1、<span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">人生和人生观</span></p>\r\n<p><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">2、人生目的及其在人生观中的地位</span><!--EndFragment--></p>', NULL, '32689', '03706', NULL, '2016-09-14 17:29:04', '2017-11-16 16:21:52'),
