	('000188', '第三节  创造有价值的人生', 'http://room.jxjycn.cn/courseware/619/201306/7d7e11270c0a61fcee3483840b23ec67.flv', 2, NULL, '<p>&nbsp;</p>\r\n<p style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" class="p0"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">1、价值和人生价值</span></p>\r\n<p style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" class="p0"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">2、人生的社会价值和自我价值</span></p>\r\n<p style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" class="p0"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">3、在创造社会价值中实现自我价值</span><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'"><?xml:namespace prefix="o" ns="urn:schemas-microsoft-com:office:office"?><o:p></o:p></span></p>\r\n<p><!--EndFragment--></p>', NULL, '32691', '03706', NULL, '2016-09-14 17:29:05', '2017-11-16 16:21:52'),
	('000189', '第四节  协调人生道路上若干关系', 'http://room.jxjycn.cn/courseware/619/201301/0dc716b0765c059f4fdca291a671a9ab.flv', 2, NULL, '<p style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" class="p0"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">1、自我生理与心理的关系</span></p>\r\n<p style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" class="p0"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">2、个人与他人的关系</span></p>\r\n<p style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" class="p0"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">3、个人与社会的关系</span></p>\r\n<p style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt" class="p0"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'">4、人与自然的关系</span><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'"><?xml:namespace prefix="o" ns="urn:schemas-microsoft-com:office:office"?><o:p></o:p></span></p><!--EndFragment-->', NULL, '32692', '03706', NULL, '2016-09-14 17:29:05', '2017-11-16 16:21:52'),
	('000190', '第一节 道德及其发展', 'http://room.jxjycn.cn/courseware/619/201306/15971c2966e8210aecbfcba80c4b2666.flv', 2, NULL, '<div>\r\n<p class="p0" style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt; TEXT-ALIGN: left"><span style="FONT-SIZE: 12pt; FONT-FAMILY: \'宋体\'; mso-spacerun: \'yes\'">道德及其发展；思想史上对道德问题的争论；道德的本质内涵解析；道德的功能和社会作用。</span><span style="FONT-SIZE: 12pt; FONT-FAMILY: \'宋体\'; mso-spacerun: \'yes\'"><?xml:namespace prefix="o" ns="urn:schemas-microsoft-com:office:office"?><o:p></o:p></span></p><!--EndFragment--></div>', NULL, '32693', '03706', NULL, '2016-09-14 17:29:06', '2017-11-16 16:21:52'),
	('000191', '第二节 社会主义道德建设的现实要求', 'http://room.jxjycn.cn/courseware/619/201306/cdade92317c038013a261bd79158df9c.flv', 2, NULL, '<p>&nbsp;</p>\r\n<p class="p0" style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt"><span style="FONT-SIZE: 12pt; FONT-FAMILY: \'宋体\'; mso-spacerun: \'yes\'">义和利的统一；社会主义道德建设与社会主义市场经济相适应；社会主义道德建设与中华民族传统美德相承接；</span></p>\r\n<p><!--EndFragment--><!--EndFragment--></p>', NULL, '32694', '03706', NULL, '2016-09-14 17:29:06', '2017-11-16 16:21:52'),
	('000192', '第三节 社会主义道德建设的核心、原则和重点', 'http://room.jxjycn.cn/courseware/619/201306/55e7fd14f43cfac08accd9a2df80430f.flv', 2, NULL, '<p>&nbsp;</p>\r\n<p class="p0" style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt; TEXT-ALIGN: left"><span style="FONT-SIZE: 12pt; FONT-FAMILY: \'宋体\'; mso-spacerun: \'yes\'">社会主义道德建设的核心是为人民服务；社会主义道德建设以集体主义为原则；社会主义道德建设的重点是诚实守信；社会主义荣辱观：以热爱祖国为荣。</span><span style="FONT-SIZE: 12pt; FONT-FAMILY: \'宋体\'; mso-spacerun: \'yes\'"><?xml:namespace prefix="o" ns="urn:schemas-microsoft-com:office:office"?><o:p></o:p></span></p>\r\n<p><!--EndFragment--><!--EndFragment--></p>', NULL, '32695', '03706', NULL, '2016-09-14 17:29:06', '2017-11-16 16:21:52'),
	('000193', '第四节 树立社会主义荣辱观', 'http://room.jxjycn.cn/courseware/619/201306/1552b34d181820b73c2a692896b9884b.flv', 2, NULL, '<p>&nbsp;</p>\r\n<p class="p0" style="MARGIN-TOP: 0pt; MARGIN-BOTTOM: 0pt; TEXT-ALIGN: left"><span style="FONT-SIZE: 12pt; FONT-FAMILY: \'宋体\'; mso-spacerun: \'yes\'">社会主义荣辱观：服务人民；崇尚科学；辛勤劳动；团结互助；诚实守信；遵纪守法；艰苦奋斗</span><span style="FONT-SIZE: 12pt; FONT-FAMILY: \'宋体\'; mso-spacerun: \'yes\'"><?xml:namespace prefix="o" ns="urn:schemas-microsoft-com:office:office"?><o:p></o:p></span></p>\r\n<p><!--EndFragment--></p>', NULL, '32696', '03706', NULL, '2016-09-14 17:29:06', '2017-11-16 16:21:52'),
