	('000209', '第一节 理想信念及其含义；第二节 科学的理想信念', 'http://room.jxjycn.cn/courseware/619/201301/f5b9ddcb81875cbe4d66c97cd6b92318.flv', 2, NULL, '<p><font style="FONT-SIZE: 12pt">1、 <span style="FONT-FAMILY: \'楷体_GB2312\'; FONT-SIZE: 12pt; mso-spacerun: \'yes\'"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 12pt; mso-spacerun: \'yes\'">人生需要理想信念；</span></span></font></p>\r\n<p><span style="FONT-FAMILY: \'楷体_GB2312\'; FONT-SIZE: 12pt; mso-spacerun: \'yes\'"><span style="FONT-FAMILY: \'宋体\'; FONT-SIZE: 14pt; mso-spacerun: \'yes\'"></span><!--EndFragment--></span><span style="FONT-FAMILY: \'楷体_GB2312\'; FONT-SIZE: 12pt; mso-spacerun: \'yes\'">2、马克思主义是科学的理想信念</span></p>\r\n<p><span style="FONT-FAMILY: \'楷体_GB2312\'; FONT-SIZE: 12pt; mso-spacerun: \'yes\'">3、中国特色社会主义是我们共同的理想信念</span></p>\r\n<p><font style="FONT-SIZE: 12pt"><span style="FONT-FAMILY: \'楷体_GB2312\'; FONT-SIZE: 12pt; mso-spacerun: \'yes\'">4、共产主义是人类最崇高的理想境界</span><span style="FONT-FAMILY: \'楷体_GB2312\'; FONT-SIZE: 12pt; mso-spacerun: \'yes\'"><span style="FONT-FAMILY: \'楷体_GB2312\'; FONT-SIZE: 12pt; mso-spacerun: \'yes\'"><p></span></span></font>', NULL, '32728', '03706', NULL, '2016-09-14 17:29:02', '2017-11-16 16:21:52'),
