	('000329', '<span style="FONT-SIZE: 10.5pt; FONT-FAMILY: 宋体">设函数</span><img style="VERTICAL-ALIGN: middle" width="99" height="44" src="http://room.jxjycn.cn/uploads/exercise/201302/20130226163522977001.gif" _ewebeditor_pa_src="http%3A%2F%2Froom.jxjycn.cn%2Fuploads%2Fexercise%2F201302%2F20130226163522977001.gif"><span style="FONT-SIZE: 10.5pt; FONT-FAMILY: 宋体">，其中</span><i><span style="FONT-SIZE: 10.5pt; FONT-FAMILY: Calibri">f</span></i><span style="FONT-SIZE: 10.5pt; FONT-FAMILY: 宋体">为可导函数，证明：</span><img style="VERTICAL-ALIGN: middle" width="120" height="44" src="http://room.jxjycn.cn/uploads/exercise/201302/20130226163522986002.gif" _ewebeditor_pa_src="http%3A%2F%2Froom.jxjycn.cn%2Fuploads%2Fexercise%2F201302%2F20130226163522986002.gif"><span style="FONT-SIZE: 10.5pt; FONT-FAMILY: 宋体">．</span>', '3', '00023', NULL, NULL, NULL, b'0', 13, '2017-11-14 09:48:26', '2017-11-14 09:48:26'),
	('000330', '<span style="FONT-SIZE: 10.5pt; FONT-FAMILY: 宋体">一质点受力</span><img style="VERTICAL-ALIGN: middle" width="112" height="40" src="http://room.jxjycn.cn/uploads/exercise/201302/20130227083834601001.gif" _ewebeditor_pa_src="http%3A%2F%2Froom.jxjycn.cn%2Fuploads%2Fexercise%2F201302%2F20130227083834601001.gif"><span style="FONT-SIZE: 10.5pt; FONT-FAMILY: 宋体">的作用，在半平面（</span><img style="VERTICAL-ALIGN: middle" width="35" height="17" src="http://room.jxjycn.cn/uploads/exercise/201302/20130227083834813002.gif" _ewebeditor_pa_src="http%3A%2F%2Froom.jxjycn.cn%2Fuploads%2Fexercise%2F201302%2F20130227083834813002.gif"><span style="FONT-SIZE: 10.5pt; FONT-FAMILY: 宋体">）上运动，其中</span><img style="VERTICAL-ALIGN: middle" width="84" height="29" src="http://room.jxjycn.cn/uploads/exercise/201302/20130227083834339003.gif" _ewebeditor_pa_src="http%3A%2F%2Froom.jxjycn.cn%2Fuploads%2Fexercise%2F201302%2F20130227083834339003.gif"><span style="FONT-SIZE: 10.5pt; FONT-FAMILY: 宋体">．证明：该力对质点所做的功与质点运动的路径无关．</span>', '3', '00023', NULL, NULL, NULL, b'0', 14, '2017-11-14 09:48:26', '2017-11-14 09:48:26'),
