	('10161', 0, '06831', NULL, 2, '&nbsp;简述常用抑制胃酸分泌的抗消化性溃疡药分类及代表药。 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;常用抗消化性溃疡药分为 ：1.H2受体阻断药，代表药为雷尼替丁等；2.M胆碱受体阻断药，代表药为哌仑西平等；3.胃壁细胞H+泵抑制药，代表药为奥美拉唑等；4.胃泌素受体阻断药，代表药为丙谷胺等。', NULL, NULL, 'H2受体|M受体|H+泵|胃泌素 ', '25|25|25|25 ', NULL, NULL, NULL),
