	('10162', 0, '06831', NULL, 2, '&nbsp;影响药物分布的因素有哪些 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;影响药物分布的因素包括：药物与血浆蛋白结合、局部器官血流量、组织亲和力、体液PH和药物理化性质、体内屏障（如血脑屏障等）.', NULL, NULL, '血浆蛋白结合|器官血流量|亲和力|药物理化性质|体内屏障 ', '20|20|20|20|20 ', NULL, NULL, NULL),
	('10163', 0, '06831', NULL, 2, ' 简述肾上腺素解救青霉素过敏性休克的药理学基础。 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;青霉素过敏性休克表现为小动脉扩张，毛细血管通透性增加，全身血容量降低，心收缩力减弱，血压降低，心率加快，支气管平滑肌痉挛，粘膜水肿，呼吸困难等。&nbsp;&nbsp;&nbsp;&nbsp; 肾上腺素可显著激动α和β受体，使小动脉和毛细血管收缩，通透性降低，兴奋心脏，改善心功能、升高血压、缓解支气管痉挛和水肿，减少过敏物质释放，迅速有效缓解过敏性休克。由药物或异性蛋白引起的过敏性休克，肾上腺素是首先药物。', NULL, NULL, '激动α受体|收缩血管|激动β受体|兴奋心脏|舒张支气管 ', '20|20|20|20|20 ', NULL, NULL, NULL),
	('10164', 0, '06831', NULL, 2, ' 简述新斯的明的临床应用 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;新斯的明为易逆性抗胆碱酯酶药，使乙酰胆碱在突触间隙积聚，表现M样和N样作用。临床主要用于用于重症肌无力﹑术后腹气胀﹑尿潴留﹑阵发性室上性心动过速及解救非去极化性肌松药中毒等。', NULL, NULL, '重症肌无力|术后腹气胀、尿潴留|阵发性室上性心动过速|解救肌松药中毒 ', '25|25|25|25 ', NULL, NULL, NULL),
	('10165', 0, '06831', NULL, 2, '&nbsp;东莨菪碱有哪些临床用途?<br> ', NULL, NULL, NULL, NULL, NULL, '&nbsp;主要用于：①麻醉前给药；②晕动病；①妊娠或放射病所致呕吐；④帕金森病等。', NULL, NULL, '麻醉|晕动病|呕吐|帕金森 ', '25|25|25|25 ', NULL, NULL, NULL),
	('10166', 0, '06831', NULL, 2, ' 简述酚妥拉明的临床应用。 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;酚妥拉明为α受体阻断剂，扩张血管，临床主要用于：1.外周血管痉挛性疾病；2.对抗静滴去甲肾上腺素外漏，避免引起组织缺血坏死；3.用于肾上腺嗜铬细胞瘤的诊断和此病骤发高血压危象以及手术前的准备；4.抗休克。机制：舒张血管，降低外周血管阻力，从而改善休克状态时的内脏血液灌注，解除微循环障碍，增加心输出量，降低肺循环阻力，5.治疗其他药物无效的急性心肌梗死及充血性心脏病所致的心力衰竭。机制：扩张血管，降低外周阻力，使心脏前后负荷明显降低，左室舒张末期压与肺动脉压下降，心搏出量增加，心力衰竭得以减轻。', NULL, NULL, '血管痉挛|去甲肾上腺素|嗜铬细胞瘤|休克|心衰 ', '20|20|20|20|20 ', NULL, NULL, NULL),
	('10172', 0, '06831', NULL, 2, '简述&nbsp;磺胺类药物与甲氧苄啶合用的意义与机制。 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;磺胺类药物抑制二氢叶酸合成酶，使二氢叶酸合成受阻；甲氧苄啶抑制二氢叶酸还原酶的活性，使二氢叶酸还原为四氢叶酸受阻；两者合用从两个环节上双重阻断敏感菌的叶酸代谢，起到协同作用。', NULL, NULL, '二氢叶酸合成酶|二氢叶酸还原酶|叶酸 ', '30|30|40 ', NULL, NULL, NULL),
	('10173', 0, '06831', NULL, 2, ' 简述胰岛素慢性耐受产生的原因。 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;&nbsp;（1）产生胰岛素抗体 &nbsp;（2）胰岛素受体数目减少，亲和力降低&nbsp;&nbsp; （3）葡萄糖转运系统失常 ', NULL, NULL, '抗体|受体|数目|亲和力|转运系统 ', '20|20|20|20|20 ', NULL, NULL, NULL),
	('10174', 0, '06831', NULL, 2, ' 简述抗菌药物的作用机制。', NULL, NULL, NULL, NULL, NULL, ' 抗菌药物的抗菌作用主要是干扰病原菌的生化代谢过程，从而影响其结构和功能，致使其失去生长繁殖的能力而起到抑制或杀灭病原菌的作用。主要有以下几种方式：①抑制细菌细胞壁合成；②影响胞浆膜通透性；③抑制细菌蛋白质合成；④影响细菌叶酸及核酸代谢。', NULL, NULL, '细胞壁|胞浆膜|蛋白质|核酸', '25|25|25|25', NULL, '2017-10-26 13:58:52', '2017-10-26 15:34:28'),
	('10175', 0, '06831', NULL, 2, '&nbsp;简述细菌产生耐药性的机制。 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;耐药性的产生有下列几种方式：①细菌胞浆膜通透性发生改变；②细菌产生灭活抗菌药物的酶；③细菌体内抗菌药原始靶位结构的改变；④细菌代谢途径的改变；⑤药物主动外排系统活性增强。', NULL, NULL, '膜通透性|灭活酶|靶位改变|代谢|主动外排系统 ', '20|20|20|20|20 ', NULL, NULL, NULL),
	('10176', 0, '06831', NULL, 2, ' 简述青霉素的主要不良反应及防治措施。 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;变态反应为青霉素类最常见的不良反应。主要防治措施：①仔细询问过敏史，对青霉素过敏者禁用；②避免滥用和局部用药；③避免在饥饿时注射青霉素；④不在没有急救药物（如肾上腺素）和抢救设备的条件下使用；⑤初次使用、用药间隔3天以上或换批号者必须做皮肤过敏试验，反应阳性者禁用；⑥注射液需临用现配；⑦病人每次用药后需观察30分钟，无反应者方可离去；⑧一旦发生过敏性休克，应首先立即皮下或肌内注射肾上腺素0.5～1.0mg,严重者应稀释后缓慢静注或滴注,必要时加入糖皮质激素和抗组胺药。同时采用其他急救措施。', NULL, NULL, '过敏史|皮试|现配|肾上腺素 ', '25|25|25|25 ', NULL, NULL, NULL),
