	('12036', 0, '00009', NULL, 2, '货币流通规律取决于哪些因素？ ', NULL, NULL, NULL, NULL, NULL, '它取决于三个因素：一是参加流通的商品数量。二是商品价格水平。三是货币流通速度。', NULL, NULL, '流通|商品数量|商品价格水平|货币流通速度 ', '10|30|30|30 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12039', 0, '00009', NULL, 2, '资本的本质是什么？区分不变资本和可变资本有什么意义？ ', NULL, NULL, NULL, NULL, NULL, '资本的本质不是物，而是体现在物上的资本主义生产关系，即被物的外壳所掩盖的资产阶级和无产阶级之间剥削和被剥削的生产关系。意义在于：第一，进一步揭露了剩余价值的源泉和资本主义剥削的实质。第二，为考察资本主义剥削程度提供了科学依据。', NULL, NULL, '生产关系|剩余价值|剥削程度|依据 ', '30|30|20|20 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12042', 0, '00009', NULL, 2, '实现资本连续循环的基本条件是什么？ ', NULL, NULL, NULL, NULL, NULL, '（1）必须保持产业资本三种职能形式在空间上并列存在，即具有并存性。（2）必须保持产业资本的每一种职能资本在时间上相继进行转化，即具有继起性。', NULL, NULL, '空间|并存性|时间|继起性 ', '20|30|20|30 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12045', 0, '00009', NULL, 2, '影响资本周转速度的因素有哪些？ ', NULL, NULL, NULL, NULL, NULL, '资本周转速度的快慢，既取决于周转时间的长短或资本周转次数的多少，又取决于生产资本的构成，即取决于固定资本和流动资本的比例，以及固定资本和流动资本自身的周转速度。', NULL, NULL, '周转时间|周转次数|生产资本|周转速度 ', '20|20|30|30 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12047', 0, '00009', NULL, 2, '资本周转速度对剩余价值生产有什么影响？ ', NULL, NULL, NULL, NULL, NULL, '首先，资本周转速度的快慢影响年剩余价值量的多少。其次，资本周转速度的快慢影响年剩余价值率的高低。', NULL, NULL, '年剩余价值量|多少|年剩余价值率|高低 ', '40|10|40|10 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12051', 0, '00009', NULL, 2, '影响利润率高低的因素有哪些？ ', NULL, NULL, NULL, NULL, NULL, '第一，剩余价值率的高低第二，资本有机构成的高低 第三，资本周转速度的快慢 第四，不变资本节省的状况', NULL, NULL, '剩余价值率|资本有机构成|周转速度|不变资本 ', '25|25|25|25 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12056', 0, '00009', NULL, 2, '垄断为什么是垄断资本主义的经济实质？ ', NULL, NULL, NULL, NULL, NULL, '第一，垄断在经济生活中占统治地位，是进入垄断资本主义阶段的标志。第二，垄断是垄断资本主义国家国内和国际生产关系的实质第三，垄断的统治加深了资本主义的基本矛盾以及其他各种资本主义所固有的矛盾第四，垄断成为垄断资本主义国家经济生活和社会生活的基础', NULL, NULL, '统治|实质|矛盾|基础 ', '25|25|25|25 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12061', 0, '00009', NULL, 2, '国家垄断资本主义有哪些基本形式?其实质是什么? ', NULL, NULL, NULL, NULL, NULL, '(1)国家与私人垄断资本融合为一体(2)国家与私人垄断资本在企业内部结合(3)国家与私人垄断资本在企业外部的结合其实质是私人垄断资本利用国家机器来为其利益服务的手段,是私人垄断资本为了维护垄断统治和获取高额垄断利润而和国家相结合的一种垄断资本主义形式,是资产阶级国家在直接参与社会资本的再生产过程中,代表垄断资产阶级总体利益并凌驾于个别垄断资本之上,对社会经济进行调节的一种形式', NULL, NULL, '国家|私人垄断资本|企业|总体利益 ', '25|25|25|25 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12071', 0, '00009', NULL, 2, '经济全球化的内容包括有哪些方面？经济全球化有哪些作用？  ', NULL, NULL, NULL, NULL, NULL, '1.其主要内容是生产全球化、贸易全球化、资本全球化2.经济全球化的积极作用：(1)实现资源在全球范围的优化配置(2)加速了技术转让和产业结构调整的进程(3)对世界经济发展起着促进作用(4)缓和国际上的一些矛盾经济全球化的负面作用:(1)经济全球化增大了各国经济连带波动的风险(2)经济全球化在旧的国际经济秩序下,会使各国的经济差距进一步拉大(3)经济全球化在旧的国际经济秩序下使发展中国家付出代价巨大,发达国家分享更多利益 ', NULL, NULL, '生产全球化|贸易全球化|资本全球化|促进作用|负面作用 ', '20|20|20|20|20 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12676', 0, '00009', NULL, 2, '我国为什么要实现和如何实现经济结构的转型？ ', NULL, NULL, NULL, NULL, NULL, '（1）发展中国家的传统部门比重较大，现代部门发展不足，这种状态既是发展中国家的经济结构所存在的突出矛盾和发展中的严重约束，也是这些国家相对贫困和落后的重要原因。发展中国家的现代化进程，在很大程度上就是要实现城乡二元经济结构向一元的现代经济转变，实现整个国民经济的现代化，这是包括我国在内的发展中国家所面临的重大历史任务。（2）我国是一个城乡二元经济结构特征十分明显的国家，存在的突出问题是农业仍基本上是传统型农业。实现我国的现代化，包括农业、工业、服务业、科学技术和国防的现代化，其中关键在于农业的现代化。在我国，没有农业的现代化，就不可能有整个国民经济的现代化。', NULL, NULL, '发展中国家|二元经济|传统农业|现代化 ', '20|30|30|20 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12679', 0, '00009', NULL, 2, '社会主义市场的基本特征是什么？ ', NULL, NULL, NULL, NULL, NULL, '我国社会主义市场的基本特征在于，它是统一、开放、竞争、有序的市场，是公有制为主体多种所有制经济共同参与的市场。社会主义市场，既具有市场的一般性，又具有我国社会主义初级阶段市场的特征。（1）它是统一的市场。（2）它是开放的市场。（3）它是竞争的市场。（4）它是有序的市场。（5）它是社会主义公有制为主体，多种所有制经济共同参与的市场。', NULL, NULL, '统一|开放|竞争|有序|公有制 ', '20|20|20|20|20 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12680', 0, '00009', NULL, 2, '我国宏观调控的任务和目标是什么？<br> ', NULL, NULL, NULL, NULL, NULL, '（1）社会主义经济运行中宏观调控的基本任务，就是保持经济总量平衡和促进经济结构优化。（2）宏观调控目标是与宏观调控任务直接相关的。党的十六大报告指出：“要把促进经济增长，增加就业，稳定物价，保持国际收支平衡作为宏观调控的主要目标。”', NULL, NULL, '总量|增长|就业|物价|国际收支 ', '20|20|20|20|20 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12684', 0, '00009', NULL, 2, '我国怎样走新型工业化的道路？<br> ', NULL, NULL, NULL, NULL, NULL, '我国走新型的工业化道路，应对工业的产业结构进行调整和优化，正确处理好以下几个方面关系？第一，走新型工业化道路要正确处理工业化和信息化的关系。第二，走新型工业化道路必须发挥科学技术作用，正确处理高新技术产业和传统产业的关系。第三，走新型工业化道路必须正确处理资金（技术）密集型产业和劳动密集型产业的关系。第四，走新型工业化道路要正确处理工业化和可持续发展的关系。', NULL, NULL, '工业化|信息化|资金密集|劳动密集|可持续 ', '20|20|20|20|20 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12689', 0, '00009', NULL, 2, '社会主义初级阶段党的基本路线是什么？<br> ', NULL, NULL, NULL, NULL, NULL, '在邓小平理论指导下，中国共产党形成了社会主义初级阶段的基本路线：领导和团结全国各族人民，以经济建设为中心，坚持四项基本原则，坚持改革开放、自力更生、艰苦创业，为把我国建设成为富强、民主、文明的社会主义现代化国家而奋斗。”以经济建设为中心，坚持两个基本点”，是这条基本路线的主要内容和简明概括。', NULL, NULL, '经济建设|基本原则|改革开放|自力更生|现代化 ', '20|20|20|20|20 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('12692', 0, '00009', NULL, 2, '现代产权制度特征是什么？ ', NULL, NULL, NULL, NULL, NULL, '归属清晰、权责明确、保护严格、流转顺畅。', NULL, NULL, '归属|权责|保护|流转\r\n ', '25|25|25|25 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
