	('20214', 0, '00009', NULL, 2, '&nbsp; \r\n<p align="left">什么是新型工业化道路？</p> ', NULL, NULL, NULL, NULL, NULL, '&nbsp; \r\n我国所要实现的工业化，有别于许多发达国家所实现的传统的工业化，而是要走新型工业化道路。其内涵是坚持以信息化带动工业化，以工业化促进信息化，走出一条科技含量高、经济效益好、资源消耗低、环境污染少、人力资源优势得到充分发挥的新型工业化道路。', NULL, NULL, '信息化|工业化|经济效益|资源|环境 ', '20|20|20|20|20 ', NULL, NULL, '2017-11-08 16:12:56'),
