	('3010869', 0, '00037', NULL, 2, '<p>简述美学发展的三个阶段。</p> ', NULL, NULL, NULL, NULL, NULL, '1、审美意识2、美学思想3、美学学科 ', NULL, NULL, '审美意识|美学思想|美学学科|科学 ', '30|30|30|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3010870', 0, '00037', NULL, 19, '美学  ', NULL, NULL, NULL, NULL, NULL, '美学是一门关于审美现象的综合性的人文学科。', NULL, NULL, '审美现象|综合性|人文学科 ', '40|20|40 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3011525', 0, '00037', NULL, 19, '意象的物态化  ', NULL, NULL, NULL, NULL, NULL, '指先把意象的心理层次牵引出来，赋矛一定的形式符号，使之以具有感性物质外观的形态呈现出来，这是从意象走向艺术的实存的第一步，使意象具有物象的形态，但还非物质实存。 ', NULL, NULL, '心理层次|形式符号|感性|艺术实存|物象 ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3011526', 0, '00037', NULL, 19, '意境  ', NULL, NULL, NULL, NULL, NULL, '主要是指运用艺术意象，在主客体交融、物我两忘的基础上，将接受者引向一个超越现实时空，富有形上本体意味的境界中。 ', NULL, NULL, '艺术意象|主客体交融|物我两忘|本体意味 ', '30|20|30|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3011527', 0, '00037', NULL, 19, '艺术的审美功能  ', NULL, NULL, NULL, NULL, NULL, '是指凭借艺术意象、意境的感染力，诱发力和震撼力来使接受主体在获得美感的同时获得审美愉悦，从而提高艺术素养，改善审美文化心理结构，拓展艺术鉴赏视野，增强艺术的想象力和敏感性。 ', NULL, NULL, '美感|审美愉悦|艺术素养|审美文化心理结构|艺术鉴赏视野|想象力|敏感性 ', '10|20|10|10|10|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3011545', 0, '00037', NULL, 19, '无我之境  ', NULL, NULL, NULL, NULL, NULL, '指创作主体的完全消失，隐在艺术意象的后面。 ', NULL, NULL, '创作主体|完全消失|艺术意象 ', '30|30|40 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012072', 0, '00037', NULL, 19, '审美距离  ', NULL, NULL, NULL, NULL, NULL, '审美距离是由瑞士美学家布洛提出的一个审美心理学概念，指的是主体在审美活动中必须与对象保持一定的心理距离。 ', NULL, NULL, '布洛|审美心理学|主体与对象|心理距离 ', '30|10|30|30 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012073', 0, '00037', NULL, 19, '集体无意识说  ', NULL, NULL, NULL, NULL, NULL, '（1）集体无意识说是由瑞士心理学家荣格提出的；（2）他认为“集体无意识”是由遗传保存下来的一种具有人类普遍性的、潜藏于意识深层的朦胧精神；（3）艺术家正是在“集体无意识”的驱动下进行创作的，艺术起源于集体无意识。（4）这是一种从起源的角度界定艺术的学说。', NULL, NULL, '荣格|人类普遍性|意识深层|起源 ', '30|30|30|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012074', 0, '00037', NULL, 19, '娱乐说  ', NULL, NULL, NULL, NULL, NULL, '娱乐说可分为“自娱”和“娱人”两个方面。艺术家借助于创作中的想象，在幻想世界中实现自己虽向往但在现实中却不能实现的愿望、追求、希冀和理想，从而达到自娱；同时，一切艺术都能使人产生快乐，都有娱人的特性和功能。 ', NULL, NULL, '自娱|娱人|想象|快乐 ', '30|30|30|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012075', 0, '00037', NULL, 19, '意象世界层  ', NULL, NULL, NULL, NULL, NULL, '意象世界层是指建立在物质实在层和形式符号层基础之上的、非现实的、展现人类审美经验的、能转化为被感性把握的、富有意味的表象世界，属于艺术品结构中的核心层次。 ', NULL, NULL, '非现实|展现审美经验|被感性把握|富有意味|核心层次 ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012473', 0, '00037', NULL, 2, '从艺术本质角度给艺术下定义有哪几种学说？  ', NULL, NULL, NULL, NULL, NULL, '1.模仿说 代表人物有柏拉图、亚里士多德，把艺术看成是再现和认识世界的一种特殊方式。2.表现说 代表人物有康德、柏格森、克罗齐，强调艺术必须以表现主体情感为主。3.有意味的形式说 由克莱夫贝尔提出，认为艺术就是艺术家创造的、能激发观赏者审美情感的纯形式。4.符号说 当代女哲学家苏珊&#8226;朗格提出，认为艺术是人类情感的符号形式。 ', NULL, NULL, '模仿说|表现说|有意味的形式说|符号说|柏拉图|康德|贝尔|朗格 ', '20|20|20|20|5|5|5|5 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012474', 0, '00037', NULL, 2, '艺术品与非艺术品的区别？  ', NULL, NULL, NULL, NULL, NULL, '1.艺术品是人工制品而不是自然物2.艺术品是精神产品，而不是物质产品3.艺术品主要是意象思维的结晶，而不是抽象思维的成果 ', NULL, NULL, '人工制品|自然物|精神产品|意象思维|抽象思维|物质产品 ', '20|20|20|20|10|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012490', 0, '00037', NULL, 2, '意象和意境的区别是什么？  ', NULL, NULL, NULL, NULL, NULL, '一、首先，虽然二者均有主客、物我、情景浑契的结构，但它们所达到的层次、深度不同，意象主要讲的是审美的广度，意境则主要就审美的深度而言，意境深邃，意象广阔。2、其次，意境是意象的升华，它是主体心灵突破了意象的域限所再造的一个虚空、灵奇的审美境界。所谓“境生于象外”，就是说意象是“意”紧紧依托着“象”，虽包含着超越性，但只有当“意”突破了“象”的束缚，向哲理性、终极性升华时才逼近了“意境”。三、再次，在中国文化中，意象属艺术范畴；而意境则指的是心灵时空的存在与运动，其范围广阔无涯，与中国人的整个哲学意识相联系。 ', NULL, NULL, '广度|深度|意境深邃|意象广阔|升华|主体心灵|艺术范畴|心灵时空|存在与运动|范围广阔 ', '10|10|10|10|10|10|10|10|10|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012507', 0, '00037', NULL, 2, '意象有哪些主要类型？  ', NULL, NULL, NULL, NULL, NULL, '意象可以从各种角度来归类，这里从主体与对象世界的关系来加以区分的。1、仿象。是主体通过模仿对象世界的形态创造出的意象，它在感性形态、具象上与对象相似，甚至非常逼真，这里，“主体”有意退居末后，其创造性仿佛就体现在意象的仿真性上。2、兴象。是主体以客观世界的物象为引导，给接受者提供借以触发情感、启动想象而完成意象世界的契机，物象使“感兴”得以发生联想得以展开，在此基础上生成的“象”便是兴象。3、喻象。喻象是创作主体以“自我”为体，以“世界”为自我的延伸，并根据主体心灵来创造新的世界。4、抽象。抽象指创作主体经过自己的头脑加工，将客体提炼、升华，舍弃具象而代用一些纯粹的形式符号来唤起读者审美情感的一种意象。 ', NULL, NULL, '仿象|兴象|喻象|抽象|主体 ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012520', 0, '00037', NULL, 19, '审美意识  ', NULL, NULL, NULL, NULL, NULL, '指人类在生存实践中萌发出来的有某种不明晰审美追求的意识。它往往通过具体感性的审美活动体现出来，缺乏明确而系统的理论表述，故而不成熟，不自觉。审美意识可分为初级审美意识和高级审美意识两个层次，初级审美意识最典型地体现在原始初民的生存活动中，高级审美意识与初级审美意识相比，更为贴近对世界和人生的整体理解，更具普遍性和更广泛的涵盖面。 ', NULL, NULL, '生存实践|审美追求|整体理解 ', '40|20|40 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012529', 0, '00037', NULL, 19, '人生境界  ', NULL, NULL, NULL, NULL, NULL, '人生境界不是自然界进化而成的物质实体，也不是主体心灵自身的幻影，而是人与世界相互依存、双向建构、一体圆融。它不是认识论层面上的主客观统一，而是存在论层面上的统一，即在人与世界相互依存、双向建构的实践活动中所达到的统一。它的特点在于它的个体内在性和生成性，它是人们通过自身锻炼修养、提高觉解水平而不断生成的。 ', NULL, NULL, '物质实体|认识论层面|存在论层面|个体内在性和生成性|提高觉解水平 ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012540', 0, '00037', NULL, 2, '简述儒、道、禅美育的“化育”特点。  ', NULL, NULL, NULL, NULL, NULL, '在儒家看来，美育的目的，乃在于让人精神上获得解放，进入一种顺应自然，与天地同体的和谐境界。到家追求的理想境界是天人合一，要求到达更高层次的人与自然的和谐。禅宗诸种自身的修养，诸种个体的自我领悟。禅宗认为，要获得解脱，只能从自己的内心着手，反对求生西方，寻求救世主。从美育的角度说，便是“自己感化自己”。在这种领悟中，禅宗突破了时空的界限，扩张了自我，从中限中看到了无限，从片刻中看到了永恒。具体方式上，禅宗虽有顿悟、渐悟之别，但客观上，他们却都注重渐修渐悟。', NULL, NULL, '精神|解放|和谐|天人合一|顿悟\r\n ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012541', 0, '00037', NULL, 2, '简述美育与德育的关系。  ', NULL, NULL, NULL, NULL, NULL, '与德育带有强制性的外在影响相比，美育的方式是动于内，从内心、从人的情感的角度去打动人心。美育与德育的方式，即竟然不同，又相辅相成，共同作用，使内和外顺。审美对人的感化往往使人亲和，充满爱心。而道德规范则是一种严肃的要求。美育又体现着以道制欲的原则。美育本来是通过适应人的感性要求和欲望的方式去感动人的。 ', NULL, NULL, '强制性|动于内|情感|感化|严肃|以道制欲 ', '10|10|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012542', 0, '00037', NULL, 19, '审美教育  ', NULL, NULL, NULL, NULL, NULL, '审美教育是以艺术和各种美的形态作为具体的媒介手段，通过审美活动展示审美对象丰富的价值意味，直接作用于受教育者的情感世界，从而潜移默化地塑造和优化人的心理结构、铸造完美人性，提升人生境界的一种有组织、有目的的定向教育方式。', NULL, NULL, '各种美的形态|价值|情感世界|塑造和优化|定向教育方式 ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012919', 0, '00037', NULL, 19, '审美形态  ', NULL, NULL, NULL, NULL, NULL, '审美形态作为对人类审美实践活动中的审美经验的逻辑总结，是在人类社会实践活动的过程中不断积淀和形成的。 ', NULL, NULL, '审美实践|审美经验|逻辑总结|社会实践|积淀和形成 ', '10|30|20|30|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012921', 0, '00037', NULL, 19, '悲剧性  ', NULL, NULL, NULL, NULL, NULL, '（1）指主人公由于坚持正义或积极进取，而与现实环境之间发生冲突；（2）在冲突中主人公在感性生命遇到摧残和毁灭的同时，成就了精神生命的永恒价值；（3）从而激起悲壮之情，使人的心灵得以净化，精神得以提升。', NULL, NULL, '冲突|精神价值|净化 ', '40|30|30 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012922', 0, '00037', NULL, 19, '喜剧性<br> ', NULL, NULL, NULL, NULL, NULL, '以笑为标志的喜剧性是人类生活和艺术中的重要美学范畴，它是以笑为手段，去否定生活中的不协调的形式，从中肯定生活中的美的艺术、社会现象、生活现象和历史事件。它的效果是引起带有社会性内容的笑。', NULL, NULL, '笑|不协调的形式|社会性的内容 ', '30|40|30 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012925', 0, '00037', NULL, 2, '简述审美形态的形成和发展特点？  ', NULL, NULL, NULL, NULL, NULL, '1、审美形态的历史性2、审美形态与思维3、审美形态与语言4、审美形态与文化 ', NULL, NULL, '历史性|思维|语言|文化|审美形态 ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012928', 0, '00037', NULL, 2, '简述优美作为审美形态的表现特征。  ', NULL, NULL, NULL, NULL, NULL, '1、优雅的人生境界2、协调的外在形式3、和谐化一的内容4、愉悦的审美体验 ', NULL, NULL, '优雅|人生境界|外在形式|和谐|内容|愉悦|审美体验 ', '5|25|25|25|5|10|5 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3012930', 0, '00037', NULL, 2, '简述崇高作为审美形态的表现特征？  ', NULL, NULL, NULL, NULL, NULL, '1、雄伟壮阔的力量之美2、价值实现的昂扬之美3、刚毅坚强的品格之美4、恢宏豪迈的尊严之美 ', NULL, NULL, '力量之美|昂扬之美|品格之美|尊严之美|价值实现|雄伟壮阔|刚毅坚强|恢宏豪迈 ', '20|20|20|20|5|5|5|5 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013111', 0, '00037', NULL, 2, '美学是一门什么样的学科？  ', NULL, NULL, NULL, NULL, NULL, '美学是一门关于审美现象的综合性的人文学科。它包括三个层面：⑴美学研究对象是审美现象也即审美活动；⑵美学是一门人文学科；⑶美学是一门综合性的人文学科。首先，美学是一门人文学科，而不是自然科学和社会科学，理由是：第一，作为人文学科的美学与自然科学、社会科学的研究对象不一样。第二，美学作为人文学科与自然科学、社会科学的研究方式和方法也不相同。 ', NULL, NULL, '人文学科|审美现象|综合性|自然科学|社会科学|研究对象|研究方法 ', '20|20|20|10|10|10|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013141', 0, '00037', NULL, 2, '请简要回答马克思实践论的主要观点。  ', NULL, NULL, NULL, NULL, NULL, '首先，马克思的实践概念是在继承和批判西方传统实践观念、特别是古典哲学的实践概念的基础上形成和发展起来的。他把实践理解为“人的感性活动”，“社会生活在本质上是实践的”。其次，马克思的实践概念是生成性的。再次，更重要的是，在马克思那里，物质生产劳动是人最基础的实践活动，它最终决定着包括艺术、审美活动在内的精神生产活动和人的一切其他实践活动。“物质生活的生产方式制约着整个社会生活、政治生活和精神生活的过程。”马克思的存在论――对人的存在的理解，经历了一个从“自我意识”到“人自身”再到“现实的人”，即从理性存在到感性自然存在再到社会存在的转变过程。 ', NULL, NULL, '实践概念|传统观念|生成性|物质生产劳动|存在论|理性存在|感性存在 ', '20|20|20|10|10|10|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013163', 0, '00037', NULL, 2, '谈谈你对审美关系的理解。  ', NULL, NULL, NULL, NULL, NULL, '第一，审美关系不是理智认识关系，而是情感体验关系。审美关系是通过对对象外观、形式的观照，返回到主体的内心，以自己内在生命的投入来领悟和体验人与世界的存在意义，进而达到一种物我两忘、圆融一体的境界。第二，审美关系是通过感性形式建立起来的，是一种感性直观的关系。第三，审美关系是人与世界之间的自由关系。自由关系是人与世界形成审美关系的关键。自由首先表现为超功利性，其次，自由表现在审美主体始终关注对象的意义形象，并且环绕这一意义形象而展开自由想象和联想。再次，自由还表现在审美是人与世界之间的精神情感交流。第四，审美关系在逻辑上先于审美主、客体而存在，而不是审美主客体逻辑上先于审美关系而存在（逻辑在先原则） ', NULL, NULL, '情感体验|感性直观系|自由关系|逻辑在先原则|审美主体|审美客体 ', '20|20|20|20|10|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013174', 0, '00037', NULL, 2, '简述审美人生境界的特点。 ', NULL, NULL, NULL, NULL, NULL, '人生境界的特点在于它的个体内在性和生成性。个体内在性――是指人生境界作为人们对人生意义的觉悟总是一种个人独特的内在体验，具有个体性，不期望别人也有同样的体验；它是个体由觉悟而生的内心的澄明，是内在的。生成性――即指非瞬间性和非凝固性，即在稳定和变化中保持一定的强力。它是一种动态过程，不是被动地成型。人生境界是人们通过自身锻炼修养、提高觉解水平而不断生成的。 ', NULL, NULL, '生成性|内在性|人生境界|动态过程|觉解 ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013259', 0, '00037', NULL, 2, '简述审美需要的特征。  ', NULL, NULL, NULL, NULL, NULL, '1、审美需要是人所独有的一种具有内在必然性的生命需要，它植根于人的生命活动本身的独特性质。2、从人的物质需要和精神需要相互区别和联系的角度看，审美需要属于人的一种高级的精神追求，而不仅仅是感官欲求的享受。 ', NULL, NULL, '生命需要|精神追求|内在必然性|独特性质|物质需要|审美需要 ', '20|20|20|20|10|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013272', 0, '00037', NULL, 2, '审美活动的特殊性是什么？  ', NULL, NULL, NULL, NULL, NULL, '1、人与世界的本己性精神交流从根本上说，审美活动是人与世界在精神上的一种交流和对话,是一种符合人性尊严，也最能体现人的本真价值的自由的生命活动。2、最具个性化的精神活动审美是一种最具个性化色彩的精神活动，它所建构的是一个具有独特生命意味的诗意的世界，根本上是超越现实功能和物质需求的一种自由的心灵体验。3、有限无功利性与最高功利性的统一所谓审美活动无功利，是说审美活动并不以某以有限目的为目的，相反它还必须以摆脱直接功利目的为前提，审美活动指向一种整体的、根本的功利性，这就是它把人向着完整的自由存在状态提升。 ', NULL, NULL, '本己性|个性化|生命意味|无功利|最高功利 ', '30|20|10|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013307', 0, '00037', NULL, 19, '审美形态  ', NULL, NULL, NULL, NULL, NULL, '审美形态――是指在审美实践活动中展现出来的，以复杂的人生样态、自由的人生境界为核心的审美情趣、审美风格等感性显现的对象化的形态，以及人们对这种不同形态的逻辑分类。', NULL, NULL, '审美实践活动|人生样态|审美情趣|审美风格|自由的人生境界 ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013326', 0, '00037', NULL, 19, '审美形态的生成性  ', NULL, NULL, NULL, NULL, NULL, '首先是指审美形态的历史生成，其次是审美形态的个体相对性生成。就历时态而言，人类许多审美形态就是在人类文明高度发展后才出现的。如丑和荒诞是在19世纪中叶以后才成为审美形态的。就共时态而言，在特定民族文化背景下产生的审美形态，要成为其他文化背景下特定民族的审美形态，就必须有个历史的顺应和同化过程。 ', NULL, NULL, '历史生成|个体相对性|审美形态 ', '40|40|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013646', 0, '00037', NULL, 2, '在艺术作品中，意象是如何生成的？  ', NULL, NULL, NULL, NULL, NULL, '意象的生产意味着艺术家心中的意象得到物态化和物化的表达。第一，意象的从无到有就是要将主体在酝酿中的隐藏在深层潜意识的意义明晰化，把散漫、不可把握的感觉整合为一个完整的整体。这个整体就是艺术意象的整体。第二，意象的从无到有，还在于意象的意义内容在“无”的运动中最终获得外在形式符号，转变为“有”。第三，意象的从无到有，没有物态化与物化的实在形式（艺术品）是不可能实现的。第四，艺术意象的创造和艺术品的完成，实际上也是一种生产（马克思把艺术生产看成是精神生产的重要形式）。', NULL, NULL, '物态化|物化的表达|深层潜意识|意义明晰化|意象整体|艺术生产|艺术品 ', '20|20|20|10|10|10|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013652', 0, '00037', NULL, 2, '艺术分类的主要原则是什么？  ', NULL, NULL, NULL, NULL, NULL, '艺术类型的划分标准尽管千差万别，但仍有内在的规律可循。从总体上来看，美学家们在划分艺术类型的时候，大致依据三种标准：第一种标准是艺术与现实之间的关系，亚氏等的分类就是一个典型的例证。第二种标准是艺术作品与欣赏者之间的关系。莱辛把艺术分为视觉艺术和听觉艺术就是此类。第三种标准则是艺术作品自身的存在方式。有些美学家把艺术划分为静态艺术与动态艺术、时间艺术与空间艺术，依据的就是这一标准。', NULL, NULL, '艺术|现实|艺术作品|欣赏者|存在方式 ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013654', 0, '00037', NULL, 19, '艺术敏感  ', NULL, NULL, NULL, NULL, NULL, '答：艺术敏感主要是指主体感受生活、欣赏艺术、体验和孕育意象的敏锐性和悟性，天才的敏感是指这种感受体验的细致、快捷、丰富和深刻。 ', NULL, NULL, '主体|敏锐性和悟性|体验的细致 ', '30|40|30 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013660', 0, '00037', NULL, 19, '艺术鉴赏中的“品”  ', NULL, NULL, NULL, NULL, NULL, '“品”是指接受者根据各自的审美文化心理结构和经验，凝神观照，发挥想象力，细致地体味作品，充实、丰富、发展意象，使意象更具接受者的个性。 ', NULL, NULL, '审美文化心理结构|凝神观照|想象力|体味|接受者的个性 ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013707', 0, '00037', NULL, 19, '经验  ', NULL, NULL, NULL, NULL, NULL, '经验一词是欧洲近代经验主义哲学的常用术语，它与纯粹思想的东西或根据权威或传统被接受的东西相对，指的是我们通过感官所知觉到的东西，包括从外部源泉或内部反省而来的东西。 ', NULL, NULL, '经验主义哲学|感官|外部源泉|内部自省 ', '25|25|25|25 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013708', 0, '00037', NULL, 19, '感性直观性 ', NULL, NULL, NULL, NULL, NULL, '是指在审美活动中，主体是凭借自己的感觉器官而不是通过抽象思维，直接而非间接地与对象打交道，而对象也是以感性外观呈现给主体，从而在主体与客体之间建立一种感性直观的联系。主体在审美活动中所形成和获得的审美经验因而也具有感性直观性。', NULL, NULL, '感觉器官|感性外观|感性直观|审美活动 ', '25|25|25|25 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013710', 0, '00037', NULL, 2, '简述审美经验与美感之间的差异。 ', NULL, NULL, NULL, NULL, NULL, '首先，美感仅仅是指主体对于对象的主观感受，而审美经验则指人在审美活动中与对象所形成的审美关系，若把二者等同，就是对审美经验作了片面化处理。其次，美感指主体在瞬间的感受和体验，审美经验则是指审美对象被构成并得到感受和评价的动态过程，它不同于没干的静态化理解。第三，美感指主体对某种现成对象作出的反应，因而美感理论实际上假定美或审美对象在审美活动开始之前已经存在了，这把审美对象与实在对象混为一谈，而审美对象是在审美活动过程中建构起来的。', NULL, NULL, '审美关系|主观感受|动态过程|感受|评价|现成对象|审美对象|实在对象 ', '20|20|20|20|5|5|5|5 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3013712', 0, '00037', NULL, 2, '审美经验的主要特征有哪些？  ', NULL, NULL, NULL, NULL, NULL, '审美经验具有以下特征;一是直观性。审美活动不同于科学、道德等活动的一个重要方面，就在于它是一种感性直观活动。审美经验的感性直观性是包含着对象和主体两方面的感性特征的。面对艺术对象时，我们主要用感官与具有感性直接性的艺术意象打交道，离开了感性直观性，就没有审美经验。二是非功利性。这是由两方面的因素决定的。首先从审美对象的角度看，审美经验只涉及事物的外观和形式。其次，从审美主体的角度看，审美经验的基本功能在于让人们产生美的愉悦，满足人们的各种需要。三是超越性。主要体现在审美经验实现从物质世界向精神世界的超越，从现实世界向理想世界的超越，从经验世界向超验世界的超越。 ', NULL, NULL, '直观性|非功利性|超越性|审美对象|审美主体|感性特征 ', '20|20|20|20|10|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3019143', 0, '00037', NULL, 2, ' 简述审美形态的基本特征。  ', NULL, NULL, NULL, NULL, NULL, '&nbsp;生成性、贯通性、兼容性、二重性1、生成性一是指审美形态的历史生成，二是指审美形态的个体相对生成。审美形态并非生而有之、一成不变的。而是伴随着人生样态的丰富、艺术种类的增多和审美经验的改善、人生境界的提高而不断生成发展的。就历时态而言，人类的许多审美形态就是在人类文明高度发展后才出现的。就共时态而言，在特定民族文化背景下产生的审美形态，要成为其他文化背景下特定民族的审美形态，就必然有个历史的顺应和同化过程。就个体审美经验的生成来说，审美形态往往以主观相对性形式表征着美在审美中生成的规则。2、贯通性是指民族文化，尤其是植根于其文化土壤中哲学思想对审美形态的统摄性。在特定文化背景下产生的审美形态，从表面上看，往往只是特定的艺术形式或艺术风格，但在这种体裁和风格的背后，实际上潜藏着文化，尤其是哲学思想的制约性，这种在制约性导致了审美形态的贯通性。3、兼容性是指审美形态是多种审美因素构成的有机体的感性凝聚，是以一定的存在形式和审美风格为特征，以人生样态和人生境界为底蕴，以审美情趣贯彻其中的有机整体。 4、二重性主要指的是民族性与世界性的统一。', NULL, NULL, '生成性|贯通性|兼容性|二重性|历史生成|个体相对生成|民族文化|审美因素|感性凝聚 ', '15|15|15|15|10|10|10|5|5 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3019146', 0, '00037', NULL, 2, ' 简述作为审美形态的悲剧的特征。  ', NULL, NULL, NULL, NULL, NULL, '&nbsp;首先，悲剧通过对人生存在的否定性体验，从而展现对人生存在价值的肯定。其次，悲剧的审美冲突体现的是人与自然、社会及自身存在的冲突和超越。最后，悲剧的情感体验是一种人生实践存在的深层体验。', NULL, NULL, '人生价值|冲突|超越|人生实践|深层体验 ', '20|20|20|20|20 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3019148', 0, '00037', NULL, 2, '简述审美经验具有非功利性的原因。  ', NULL, NULL, NULL, NULL, NULL, '首先，从审美对象的角度来看，由于审美经验具有直观性的特点，因此凡涉及事物的外观和形式，与事物的实际存在毫无关系，自然也就不会与对象发生任何利害关系其次，从审美主体的角度来看，审美经验的基本功能在于让人们产生审美的愉悦，从而满足人们的审美需要，这就要求人们排除各种功力因素的干扰，因为这些因素的存在不可避免地会损害或者减弱人们的审美愉悦&nbsp;&nbsp;', NULL, NULL, '审美对象|直观性|利害关系|审美主体|审美需要|审美愉悦 ', '20|20|20|15|15|10 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3019151', 0, '00037', NULL, 2, '简述艺术品的层次结构。  ', NULL, NULL, NULL, NULL, NULL, '&nbsp;一、物质实在层（存在层次） 1、指艺术品赖以在时空中存在的物质实体和媒介，是就艺术品作为物质实体，由各种物质材料构成的存在而言的，是间接性物质存在&nbsp;2、不同的艺术门类所赖以存在的物质材料，有其相对的稳定性和界限；在一定条件下，物质实在本身亦有助于审美意象的创造二、形式符号层（过渡层次）1、各类艺术都有自己独特的指向意象世界的形式符号，是艺术品直接性物质存在2、形式符号层有时有其独立的审美价值，更重要的还在于它直接指示、负载着艺术的意象世界 三、意象世界层（核心层次） 1、指建立在前两个层次基础上的、非现实的、展现人类审美经验的、能转化为被感性把握的、富有意味的表象世界，这是艺术品结构中的核心层次&nbsp;2、意象世界指潜在地存在于形式符号层中，而现实地生成于接受者鉴赏时的心理活动中，艺术品的审美特质和价值集中体现于此四、意境超验层（终极和归宿）&nbsp;1、是意象世界背后所蕴含的富有形而上的人生哲理意味的最高境界，有广义和狭义之分，一是就人生境界而言，一是就艺术品本身的内涵而言&nbsp;2、意境的超验层是以意象世界层为中介的，没有意象的导引，意境无从谈起。&nbsp;从物质实在层到形式符号层，到意象世界层，再到意境超验层，艺术品一层层走向了纵深。可见，艺术品是一个动态的、开放的、不断生成的结构系统，又是一个内在统一的有机的整体，其中各个层次相互联系，相互依凭，层层相衔，环环相扣，缺一不可，只有在整体的结构系统中才有存在价值与地位，离开了整体，每一单个层次都毫无意义', NULL, NULL, '物质实在|形式符号|意象世界|意境超验|存在|过渡|核心 ', '20|20|20|20|10|5|5 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
	('3019155', 0, '00037', NULL, 2, '&nbsp;<strong>审美经验包含哪些基本要素？</strong>  ', NULL, NULL, NULL, NULL, NULL, '&nbsp;审美经验的诸构成要素主要有：感知、想象、情感、理解。感知，包括感觉和知觉。感觉是对于对象的个别属性的把握。知觉是能够通过感觉材料的加工和整理而达到对于对象的完整把握。审美感知的特点：情感性、能动选择性和整体性。想象，是审美经验的核心要素。从心理学角度讲，想象是一种通过加工和改造记忆中的表象来创造新的思维表象的过程。情感，是审美经验中最为活跃的因素。审美情感具有更为显著的社会性和理性特征。理解，非概念性和多义性。 ', NULL, NULL, '感知|想象|情感|理解|社会性|理性|思维表象|非概念性|多义性 ', '15|15|15|15|10|10|10|5|5 ', NULL, '2017-11-10 11:00:50', '2017-11-10 11:00:50'),
