	('56224', 0, '00009', NULL, 2, '<p>货币的本质和职能是什么</p> ', NULL, NULL, NULL, NULL, NULL, '货币的本质是固定充当一般等价物的商品，体现着商品生产者之间的社会经济关系。\r\n货币的职能是货币本质的具体体现。货币具有五种职能：价值程度，流通手段，贮藏手段，支付手段，世界货币。', NULL, NULL, '一般等价物|价值程度|流通手段|贮藏手段 ', '30|25|25|20 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('56225', 0, '00009', NULL, 2, '垄断资本主义的基本特征是什么？ ', NULL, NULL, NULL, NULL, NULL, '垄断\r\n金融资本和金融寡头的统治\r\n资本输出在经济生活中占统治地位\r\n国际垄断组织在经济上瓜分世界\r\n垄断资本主义国家对世界领土的瓜分', NULL, NULL, '垄断|金融寡头|资本输出|国际垄断组织\r\n\r\n\r\n\r\n\r\n ', '30|25|25|20 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('56226', 0, '00009', NULL, 2, '影响资本积累量的主要因素 ', NULL, NULL, NULL, NULL, NULL, '剩余价值率的高低；\r\n社会劳动生产率的高低；\r\n所用资本和所费资本差额的大小；\r\n预付资本的大小', NULL, NULL, '剩余价值率|劳动生产率|所用资本|预付资本 ', '30|25|25|20 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('56232', 0, '00009', NULL, 2, '划分不变资本和可变资本的依据和意义是什么？ ', NULL, NULL, NULL, NULL, NULL, '依据资本各部分在剩余价值生产中所起的作用不同。\r\n划分不变资本和可变资本的意义在于：第一，进一步揭露了剩余价值的源泉；第二，为正确地考察资本家对雇佣工人的剥削程度提供了科学依据。', NULL, NULL, '作用|不同|剩余价值|剥削程度 ', '10|10|40|40 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('57041', 0, '00009', NULL, 2, '为什么必须在改革中转变政府经济职能？ ', NULL, NULL, NULL, NULL, NULL, '（1）我国在过去长时期里，把政府领导和管理经济的职能，同政府机关直接经营管理国有企业相等同，习惯于用行政命令办法来直接指挥和管理各种社会经济活动，包括企业的生产经营活动。 （2）特别是没有实行国有资产的所有权同企业经营管理权的分离，把国有企业资产由代表全民的国家所有同国家机构对企业的直接经营管理相混同，严重地存在着政企不分和所有权与经营权不分问题，政府对企业管理太多太死，企业成为政府行政机构的附属物。这是企业缺乏活力的重要原因，严重束缚了生产力的发展，因而必须在改革中转变政府经济职能。 ', NULL, NULL, '政企|所有权|经营权|企业|活力 ', '30|20|20|15|15 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('57046', 0, '00009', NULL, 2, '建立和完善社会主义市场经济体制要搞好哪四个相互联系的重要环节？ ', NULL, NULL, NULL, NULL, NULL, '（1）积极推进企业改革，构造社会主义市场经济的微观基础。（2）加快市场体系的培育，完善社会主义市场经济的流通渠道。（3）深化分配制度和社会保障制度的改革，建立公平与效率相统一的分配制度。（4）加快政府职能的转变，建立高效的宏观调控体系。', NULL, NULL, '企业|市场|分配|政府 ', '25|25|25|25 ', NULL, '2017-11-08 16:12:55', '2017-11-08 16:12:55'),
	('605', 0, '03706', NULL, 5, '联系实际论述如何正确认识并处理理想与现实的关系？  ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '理想|长期性|曲折性|艰巨性|矛盾|辩证统一|主观|客观|完美|幻想 ', '10|10|10|10|10|10|10|10|10|10 ', NULL, '2016-09-14 17:30:26', '2017-11-07 09:44:59'),
	('606', 0, '03706', NULL, 5, '在经济全球化背景下，我们怎样弘扬爱国主义精神？ ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '经济全球化|利益|国家主权|爱国主义|民族凝聚力|民族传统文化|政治|经济|文化|国情 ', '10|10|10|10|10|10|10|10|10|10 ', NULL, '2016-09-14 17:30:26', '2017-11-07 09:44:59'),
	('607', 0, '03706', NULL, 5, '在现实生活中，怎样用积极的人生态度对待人生境遇？ ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '顺境|逆境|建功立业|磨练|居安思危|怨天尤人|自暴自弃|有利条件|战胜困难|积极 ', '10|10|10|10|10|10|10|10|10|10 ', NULL, '2016-09-14 17:30:26', '2017-11-07 09:44:59'),
	('608', 0, '03706', NULL, 5, '为什么我国社会主义道德建设要以为人民服务为核心？\r\n&nbsp; ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '为人民服务|经济基础|政治制度|人民根本利益|市场经济|共同富裕|社会主义本质|道德要求|基本标准|幸福 ', '10|10|10|10|10|10|10|10|10|10 ', NULL, '2016-09-14 17:30:26', '2017-11-07 09:44:59'),
	('609', 0, '03706', NULL, 5, '如何树立社会主义荣辱观？ ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '社会主义荣辱观|知荣知耻|明荣辨耻|科学内涵|个人|集体|国家|赞扬|反对|生活方式 ', '10|10|10|10|10|10|10|10|10|10 ', NULL, '2016-09-14 17:30:26', '2017-11-07 09:44:59'),
	('610', 0, '03706', NULL, 5, '论述个人品德的含义及形成良好个人品德的意义是什么？ ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '个人品德|道德原则|道德素质|行为习惯|道德情感|道德评价|道德境界|社会交往|社会生活|道德规范 ', '10|10|10|10|10|10|10|10|10|10 ', NULL, '2016-09-14 17:30:26', '2017-11-07 09:44:59'),
	('611', 0, '03706', NULL, 5, '社会公德的内容及遵守社会公德的意义是什么？ ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '社会公德|文明礼貌|助人为乐|爱护公物|保护环境|遵纪守法|文明上网|社会秩序|精神文明|道德境界 ', '10|10|10|10|10|10|10|10|10|10 ', NULL, '2016-09-14 17:30:26', '2017-11-07 09:44:59'),
	('68686', 0, '03706', NULL, 2, '当代大学生的历史使命是什么？ ', NULL, NULL, NULL, NULL, NULL, '（1）继往开来，建设中国特色社会主义。\r\n（2）勇于创新，实现中华民族的伟大复兴。\r\n（3）积极努力，为世界和平发展、人类社会进步事业做贡献。', NULL, NULL, '建设|创新|中华民族|和平发展|社会进步 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68687', 0, '03706', NULL, 2, '人生的责任和使命如何理解？ ', NULL, NULL, NULL, NULL, NULL, '责任就是分内应该做的事情。使命被喻为重大的责任。人生的责任和使命就是作为人生应该做的事情和应该担负的重大责任。', NULL, NULL, '责任|使命|人生|事情|担负 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68688', 0, '03706', NULL, 2, '理想信念在人生中具有哪些方面重要作用？ ', NULL, NULL, NULL, NULL, NULL, '（1）理想信念是人生的精神向导。\r\n（2）理想信念是人生的精神动力。\r\n（3）理想信念是人生的精神支柱。', NULL, NULL, '理想信念|精神向导|精神动力|精神支柱|作用 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68689', 0, '03706', NULL, 2, '简述理想实现的长期性、曲折性和艰巨性。 ', NULL, NULL, NULL, NULL, NULL, '（1）充分认识理想实现过程的长期性。\r\n（2）理想的实现具有曲折性。\r\n（3）理想的实现具有艰巨性。', NULL, NULL, '理想|实现|长期性|曲折性|艰巨性 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68690', 0, '03706', NULL, 2, '简述爱国主义的基本内容。 ', NULL, NULL, NULL, NULL, NULL, '（1）热爱故土山河是爱国主义的重要内容。\r\n（2）热爱人民是爱国主义的集中体现。\r\n（3）热爱自己的国家是爱国主义的必然政治要求。', NULL, NULL, '爱国主义|国家|人民|家园|政治要求 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68691', 0, '03706', NULL, 2, '中华民族爱国主义的优良传统主要包括哪些内容？ ', NULL, NULL, NULL, NULL, NULL, '（1）维护祖国统一，促进民族团结。\r\n（2）抵御外来侵略，捍卫国家主权。\r\n（3）开发祖国山河，创造中华文明。\r\n（4）心系民生苦乐，推动历史进步。', NULL, NULL, '祖国统一|民族团结|国家主权|中华文明|历史进步 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68692', 0, '03706', NULL, 2, '在新时期，怎样做一个忠诚的爱国者？ ', NULL, NULL, NULL, NULL, NULL, '（1）培育爱国情感，保持民族自尊和自信。\r\n（2）维护民族团结，促进祖国统一。\r\n（3）努力学习和工作，以实际行动和贡献履行爱国义务。', NULL, NULL, '民族自尊|民族团结|祖国统一|爱国情感|刻苦学习 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68693', 0, '03706', NULL, 2, '当代大学生应该以怎样的实际行动来履行自己的爱国义务？ ', NULL, NULL, NULL, NULL, NULL, '（1）刻苦学习科学文化知识，掌握建设祖国和保卫祖国的过硬本领。\r\n（2）树立正确的思想政治观念，自觉维护祖国安定、团结统一。\r\n（3）积极投身社会实践，逐步从爱国主义走向共产主义。', NULL, NULL, '科学知识|政治观念|团结统一|爱国主义|共产主义 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68694', 0, '03706', NULL, 2, '简答人生目的在人生观中的核心地位？ ', NULL, NULL, NULL, NULL, NULL, '（1）人生目的决定走什么样的人生道路。它规定人生活动的大方向，起着定向作用和人生行动的动力源泉作用。\r\n（2）人生目的决定持什么样的人生态度。\r\n（3）人生目的决定选择什么样的人生价值标准。', NULL, NULL, '人生目的|人生道路|人生态度|动力源泉|价值标准 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68695', 0, '03706', NULL, 2, '怎样科学地协调自我身心关系？ ', NULL, NULL, NULL, NULL, NULL, '（1）树立正确的人生观，养成积极乐观的人生态度。\r\n（2）参加体育锻炼，提高身体素质和心理品质。\r\n（3）学习心理健康知识，掌握心理调适方法。\r\n（4）注重与他人交往，建立良好的人际关系。', NULL, NULL, '人生态度|身心健康|心理品质|身体素质|人际交往 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68696', 0, '03706', NULL, 2, '<p>如何正确处理个人和社会的关系？</p>\r\n<p>&nbsp;</p> ', NULL, NULL, NULL, NULL, NULL, '（1）在社会发展中认识自我、调整和充实自我。离开了社会发展的进程就无法认识自我、调整自我和充实完善发展自我。\r\n（2）在个人发展中要承担社会责任，履行社会义务。社会是人的社会，人是社会的人，个人的生存和发展离不开社会，而社会的进步又必须依赖个人的劳动和创造。', NULL, NULL, '社会发展|认识自我|社会责任|社会义务|社会进步 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68697', 0, '03706', NULL, 2, '<p>道德的起源是什么？</p> ', NULL, NULL, NULL, NULL, NULL, '（1）劳动是道德起源的第一个历史前提。\r\n（2）社会关系的形成是道德赖以产生的客观条件。\r\n（3）人类自我意识的形成和发展是道德产生的主观条件。', NULL, NULL, '劳动|道德起源|社会关系|自我意识|条件 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68698', 0, '03706', NULL, 2, '道德的功能有哪些？ ', NULL, NULL, NULL, NULL, NULL, '道德的功能是指道德作为社会意识的特殊形态对社会发展所具有的功效和能力。道德有多方面的功能，如调节功能、认识功能、教育功能、评价功能、导向功能|、激励功能等，其中占主要地位的是调节功能和认识功能。', NULL, NULL, '功效|能力|功能|调节功能|认识功能 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68699', 0, '03706', NULL, 2, '为什么我国社会主义道德建设要与社会主义法律规范相协调？ ', NULL, NULL, NULL, NULL, NULL, '（1）社会主义道德和社会主义法律相互联系、相互补充。\r\n（2）社会主义德治和社会主义法治相辅相存、相互促进。\r\n（3）社会主义道德和社会主义法律在内容上相互衔接、相互协调，在作用上相辅相存、相互促进。', NULL, NULL, '法律|道德|基础|调节|法治 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68700', 0, '03706', NULL, 2, '中华民族传统美德的主要内容是什么？ ', NULL, NULL, NULL, NULL, NULL, '（1）爱国奉献，以天下为己任。\r\n（2）勤劳勇敢，追求自由解放。\r\n（3）求真务实，敬重诚实守信。\r\n（4）乐群贵和，强调人际和谐。\r\n（5）励志自强，崇尚精神境界。\r\n（6）德性修养，重视躬行慎独。', NULL, NULL, '爱国奉献|勤劳勇敢|诚实守信|人际和谐|躬行慎独 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68701', 0, '03706', NULL, 2, '社会主义集体主义原则的基本内涵是什么？ ', NULL, NULL, NULL, NULL, NULL, '（1）强调集体利益和个人利益的辩证统一。\r\n（2）强调集体利益高于个人利益。\r\n（3）强调重视、保障、发展个人的正当利益和自觉创造精神。', NULL, NULL, '集体利益|个人利益|辩证统一|正当利益|自觉创造 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68702', 0, '03706', NULL, 2, '<p>当代社会公共生活有哪些主要特点？</p> ', NULL, NULL, NULL, NULL, NULL, '（1）活动范围的广泛性。\r\n（2）交往对象的复杂性。\r\n（3）活动方式的多样性。\r\n（4）活动结果的相关性', NULL, NULL, '公共生活|广泛性|复杂性|多样性|相关性 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68703', 0, '03706', NULL, 2, '<p>简述社会公德的特点。</p>\r\n<p>&nbsp;</p> ', NULL, NULL, NULL, NULL, NULL, '（1）基础性。社会公德是社会道德体系的基础层次，是每个社会成员应该遵守的道德准则，是维护社会公共生活正常运行的最基本的道德要求。\r\n（2）全民性。社会公德是社会全体成员必须遵守的道德规范，具有广泛的群众性适用范围。\r\n（3）相对稳定性。在社会发展中与其他的各种道德分支相比，较具稳定性。', NULL, NULL, '社会公德|基础性|全民性|稳定性|道德要求 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68704', 0, '03706', NULL, 2, '职业道德的特点有哪些？ ', NULL, NULL, NULL, NULL, NULL, '（1）规范性和专业性。\r\n（2）可操作性与准强制性。\r\n（3）相对稳定性和连续性。', NULL, NULL, '职业道德|规范性|专业性|操作性|稳定性 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68705', 0, '03706', NULL, 2, '如何提高职业道德素质？ ', NULL, NULL, NULL, NULL, NULL, '（1）努力学习，增强职业道德意识。\r\n（2）努力塑造优良的职业品质。\r\n（3）努力锻炼实际履行职业道德规范的能力。', NULL, NULL, '职业道德|职业品质|道德素质|道德规范|道德行为 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68706', 0, '03706', NULL, 2, '爱情的基本特征有哪些？ ', NULL, NULL, NULL, NULL, NULL, '（1）平等互爱性\r\n（2）专一排他性\r\n（3）强烈持久性\r\n（4）纯洁严肃性', NULL, NULL, '爱情|平等互爱性|专一排他性|强烈持久性|纯洁严肃性 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68707', 0, '03706', NULL, 2, '简述依法治国基本方略的重大意义？ ', NULL, NULL, NULL, NULL, NULL, '（1）依法治国\r\n（2）科学发展观\r\n（3）基本方略(4)&nbsp;和谐社会(5)现代化', NULL, NULL, '依法治国|科学发展观|基本方略|和谐社会|现代化 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68708', 0, '03706', NULL, 2, '法的本质特征是什么？ ', NULL, NULL, NULL, NULL, NULL, '（1）法是体现统治阶级意志的社会规范。\r\n（2）法是由国家强制力保障实施的社会规范。\r\n（3）法是受社会物质生活条件决定的社会规范。', NULL, NULL, '法|阶级意志|国家强制力|社会规范|物质生活条件 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68709', 0, '03706', NULL, 2, '法的规范作用是什么？ ', NULL, NULL, NULL, NULL, NULL, '（1）指引作用。\r\n（2）评价作用\r\n（3）预测作用\r\n（4）教育作用\r\n（5）制裁作用', NULL, NULL, '法|指引作用|评价作用|教育作用|制裁作用 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
	('68710', 0, '03706', NULL, 2, '宪法的特征是什么？ ', NULL, NULL, NULL, NULL, NULL, '（1）宪法是国家的根本法，宪法的内容不同于一般法律。\r\n（2）宪法是一切国家机关、社会团体和全体公民必须遵循的最高准则，宪法具有最高的法律效力。\r\n（3）宪法的制定和修改程序更为严格。', NULL, NULL, '宪法|根本法|法律|效力|程序 ', '20|20|20|20|20 ', NULL, '2017-11-07 09:44:58', '2017-11-07 09:44:58'),
