	('8836', 0, '06831', NULL, 2, '&nbsp;比较第一、二、三、四代头孢菌素的抗菌作用及临床应用特点 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;第一代：抗菌范围与青霉素相似，对G+菌作用较第二、三代强，对G-菌作用差。可被细菌产生的β-内酰胺酶破坏，有肾毒性。主要用于敏感菌所致呼吸道和尿路感染、皮肤及软组织感染。&nbsp;&nbsp;&nbsp; 第二代：对G+菌作用略逊于第一代，对G-菌有明显作用，对厌氧菌有一定作用，但对铜绿假单胞菌无效。对多种β-内酰胺酶比较稳定。肾毒性较第一代有所降低。可用于治疗敏感菌所致肺炎、胆道感染、菌血症、尿路感染和其他组织器官感染等。&nbsp;&nbsp;&nbsp; 第三代：对G+菌作用不及第一、二代，对G-菌包括肠杆菌类、铜绿假单胞菌及厌氧菌有较强的作用。对β-内酰胺酶有较高的稳定性，对肾脏基本无毒。可用于危及生命的败血症、脑膜炎、肺炎、骨髓炎、及尿路严重感染的治疗，能有效控制严重的铜绿假单胞菌感染。第四代：对G-菌作用更强，对β-内酰胺酶更稳定，无肾毒性，可用于敏感的金黄色葡萄球菌、链球菌、流感嗜血杆菌引起的肺炎、菌血症、败血症等。', NULL, NULL, 'G+菌|G-菌|β-内酰胺酶|肾脏毒性 ', '20|20|30|30 ', NULL, NULL, NULL),
	('8837', 0, '06831', NULL, 2, '&nbsp;简述如何预防氨基糖苷类抗生素对第八对脑神经及肾脏的损害。<br> ', NULL, NULL, NULL, NULL, NULL, '&nbsp;用药过程中应密切观察，注意是否出现耳鸣.眩晕等早期症状，并进行听力监测和肾功能检查，根据情况调整剂量。避免与有耳毒性和肾毒性的药物合用，避免和抗组胺药合用。老年人和肾功能不全者减量或慎用，孕妇禁用。', NULL, NULL, '耳鸣|听力监测|肾功|耳毒性|抗组胺 ', '20|20|20|20|20 ', NULL, NULL, NULL),
