	('92868', 0, '03706', NULL, 0, '“国而忘家，公而忘私”，“先天下之忧而忧，后天下之乐而乐”，“天下兴亡，匹夫有责”等，这些思想表达了中国传统美德中的（）', '求真务实，敬重诚实守信', '爱国奉献，以天下为己任', '乐群和贵，强调人际和谐', '勤劳勇敢，追求自由解放', 'null', NULL, 'B', NULL, NULL, NULL, NULL, '2016-09-14 17:29:41', '2017-11-07 09:44:58'),
	('9524', 0, '06831', NULL, 20, ' 肝素过量引起的出血可用<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </u>拮抗。  ', NULL, NULL, NULL, NULL, NULL, ' 硫酸鱼精蛋白', NULL, NULL, '鱼精蛋白 ', '100 ', NULL, NULL, NULL),
	('9902', 0, '06831', NULL, 20, ' 抗消化性溃疡药物分为<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;、抗酸药，胃粘膜保护药，抗幽门螺旋杆菌药四类  ', NULL, NULL, NULL, NULL, NULL, '&nbsp;抑制胃酸分泌药', NULL, NULL, ' 抑制胃酸分泌 ', '100 ', NULL, NULL, NULL),
	('9903', 0, '06831', NULL, 20, ' 长期使用糖皮质激素突然停药会引起<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </u>和医源性肾上腺皮质功能不全 。  ', NULL, NULL, NULL, NULL, NULL, ' 反跳现象', NULL, NULL, ' 反跳现象 ', '100 ', NULL, NULL, NULL),
	('9904', 0, '06831', NULL, 20, ' 氨基糖苷类抗生素的主要不良反应是耳毒性、肾毒性、<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </u>和过敏反应。  ', NULL, NULL, NULL, NULL, NULL, '神经肌肉阻滞作用 ', NULL, NULL, '神经肌肉阻滞作用 ', '100 ', NULL, NULL, NULL),
	('9905', 0, '06831', NULL, 20, ' 氯霉素的主要不良反应是<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </u>，其症状有二，一为可逆性血细胞减少，二为不可逆性再生障碍性贫血&nbsp;。  ', NULL, NULL, NULL, NULL, NULL, ' 抑制骨髓造血 ', NULL, NULL, ' 抑制骨髓 ', '100 ', NULL, NULL, NULL),
	('9914', 0, '06831', NULL, 2, '&nbsp;简述硝酸酯类与普奈洛尔联合应用的抗心绞痛作用基础 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;两药联合应用可产生协同作用：硝酸酯类可通过扩张小动脉和小静脉，减少回心血量，心室容积缩小，室壁张力及外周阻力下降，心肌耗氧量减少。普奈洛尔通过抑制心肌收缩力，减慢心率，降低心肌耗氧量，故可产生协同作用。(2)两药联合应用又可相互取长补短：硝酸酯类有反射性引起心率加快的缺点，普奈洛尔有引起心室增大和射血时间延长的不足。二者联合用药时，普奈洛尔可取消硝酸酯类引起的反射性心率加快；而硝酸酯类可缩小普奈洛尔引起的心室容积扩大和射血时间延长。所以硝酸酯类与普奈洛尔联合应用可达到消除各自不良反应并协同降低心肌耗氧量，增强抗心绞痛的目的。', NULL, NULL, '协同作用|心率加快|心室容积|射血时间 ', '30|30|20|20 ', NULL, NULL, NULL),
	('9915', 0, '06831', NULL, 2, '&nbsp;简述常用利尿药的分类、主要作用部位及作用机制。 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;按其效能和作用部位分为三类。（1）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 高效利尿药：主要作用与髓袢升枝粗段髓质部和皮质部，如呋塞米、布美他尼、依他尼酸等。作用机制：抑制Na+-K+-2Cl-共同转系统。（2）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 中效利尿药：主要作用于远曲小管始端，如噻嗪类、氯噻酮等。作用机制：抑制Na+-Cl-共同转系统。（3）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 低效利尿药：主要作用于远曲小管和集合管，如螺内酯、氨苯喋啶、阿米洛利等。作用机制：螺内酯竞争性拮抗醛固酮受体；氨苯喋啶、阿米洛利阻滞钠离子通道，抑制氯化钠再吸收。', NULL, NULL, 'Na+-K+-2Cl-|Na+-Cl-|醛固酮|钠离子通道 ', '25|25|25|25 ', NULL, NULL, NULL),
	('9916', 0, '06831', NULL, 2, '&nbsp;强心苷对心脏的作用及作用机制 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;强心苷对心脏的作用:（1）正性肌力；（2）减慢心率；（3）减慢房室传导作用机制：抑制心肌细胞膜上Na+-K+-ATP酶，导致钠泵失灵，进而使心肌细胞内Ca2+增加而增加心肌收缩力。', NULL, NULL, '正性肌力|负性频率|减慢传导|Na+-K+-ATP酶 ', '20|20|20|40 ', NULL, NULL, NULL),
	('9917', 0, '06831', NULL, 2, '&nbsp;简述治疗充血性心力衰竭的药物分类及主要代表药。 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;治疗治疗充血性心力衰竭的药物分类：1.增强心肌收缩力的药物：（l）强心苷类，如地高辛；（2）非强心苷类正性肌力药，如米力农。２.作用于β受体的药物：（１）β受体阻断药，如美托洛尔、卡维地洛（２）β１受体激动药：多巴酚丁胺。３.减轻心脏负荷的药物：（１）作用于RAAS系统的药物，血管紧张素转化酶抑制药，如卡托普利等；血管紧张素Ⅱ受体拮抗药，如氯沙坦（２）利尿药，如氢氯噻嗪（３）扩血管药；如硝普钠、哌唑嗪等； ', NULL, NULL, '心肌收缩力|β受体|血管紧张素转化酶|利尿药|扩血管 ', '40|30|10|10|10 ', NULL, NULL, NULL),
	('9918', 0, '06831', NULL, 2, '&nbsp;简述肝素与华法林的异同点 ', NULL, NULL, NULL, NULL, NULL, '相同点：都具有抗凝作用；都可防止血栓栓塞性疾病；不良反应均易出血。不同点：肝素口服无效，常静脉给药；起效快，维持时间短；机制是激活和强化抗凝血酶Ⅲ，体内、外均有强大的抗凝作用；自发性出血用鱼精蛋白解救。华法林口服有效；起效慢，但维持时间长；机制是维生素K拮抗剂，只有在体内有效，体外无效；自发性出血用维生素K解救。', NULL, NULL, '抗凝|出血|口服|抗凝血酶Ⅲ|维生素K ', '15|15|20|20|30 ', NULL, NULL, NULL),
	('9919', 0, '06831', NULL, 2, '&nbsp;苯二氮卓类的药理作用 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;抗焦虑作用；镇静催眠作用；抗惊厥作用；中枢性肌松作用', NULL, NULL, '抗焦虑|镇静|催眠|抗惊厥|肌松 ', '20|20|20|20|20 ', NULL, NULL, NULL),
	('9966', 0, '06831', NULL, 2, '&nbsp;简述左旋多巴与卡比多巴治疗帕金森病的机理。 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;⑴左旋多巴口服后，仅少量能进入中枢神经系统，绝大部分在外周脱羧酶的作用下转变为多巴胺，而多巴胺不能通过血脑屏障，不能在中枢发挥治疗作用。⑵卡比多巴是外周脱羧酶抑制剂，与左旋多巴合用时，使左旋多巴在外周的脱羧作用被抑制，进入中枢神经系统的左旋多巴增加，在中枢脱羧酶的作用下转变为多巴胺，增加脑内多巴胺的含量，发挥治疗作用。', NULL, NULL, '抑制|外周脱羧酶|中枢 ', '30|40|30 ', NULL, NULL, NULL),
	('9967', 0, '06831', NULL, 2, ' 简述普萘洛尔的临床应用。 ', NULL, NULL, NULL, NULL, NULL, '&nbsp;普萘洛尔属β受体阻断药，通过阻断不同部位的β受体产生不同的疗效。临床主要用于治疗心律失常、心绞痛、高血压、甲状腺功能亢进等。', NULL, NULL, '心律失常|心绞痛|高血压|甲亢 ', '25|25|25|25 ', NULL, NULL, NULL),
	('9984', 0, '06831', NULL, 2, '&nbsp;试比较吗啡和阿司匹林对疼痛影响的区别。 ', NULL, NULL, NULL, NULL, NULL, ' 1.作用部位不同：吗啡镇痛作用主要在中枢，阿司匹林主要在外周2.镇痛原理不同：吗啡激动阿片受体，阿司匹林抑制PG合成3.作用效力不同：吗啡镇痛作用强大，阿司匹林具有中等强度的镇痛作用4.适应症不同：吗啡主要用于急性锐痛，阿司匹林用于钝痛不良反应：吗啡有成瘾性，阿司匹林主要是胃肠道反应', NULL, NULL, '阿片受体|前列腺素|成瘾性|胃肠道反应|部位|效力|适应症 ', '10|10|10|10|20|20|20 ', NULL, NULL, NULL);
