	('000003', '网站系统通知测试', '管理员', '000003', b'1', b'1', 1, '<h1 id="p_title" style="text-align:center;font-weight:normal;font-size:26px;font-family:微软雅黑;color:#2D0201;background-color:#FFFFFF;">\r\n	<span style="font-size:24px;">网报系统紧急通知</span>\r\n</h1>\r\n<p style="text-align:center;">\r\n	<span style="font-size:24px;"><span style="color:#2D0201;font-family:宋体;font-size:14px;background-color:#FFFFFF;">由于技术原因，目前部分专业技术人员资格考试报名系统运行缓慢，影响了部分考试的报名，我们正在抓紧修复。受此影响的考试报名我们将顺延报名时间，保证所有需要报名参加考试的人员都能报上名参加考试，请广大考生放心。</span><br />\r\n</span>\r\n</p>\r\n<p style="text-align:center;">\r\n	<span style="font-size:24px;"><br />\r\n</span>\r\n</p>\r\n<p style="text-align:right;">\r\n	<span style="font-size:24px;"><span style="color:#2D0201;font-family:宋体;font-size:14px;background-color:#FFFFFF;">(责编：王金雪、秦华)</span><br />\r\n</span>\r\n</p>', '2017-10-24 14:18:27', '2017-10-24 14:45:31'),
	('000004', '关于订单接口无法获取订单号说明公告', '系统', '000004', b'1', b'1', 1, '<div style="text-align:center;">\r\n	<span style="font-size:32px;">尊敬的京东客户您好<img src="http://localhost/sse/lib/zui/lib/kindeditor/plugins/emoticons/images/52.gif" alt="" border="0" />！</span> \r\n</div>\r\n<div style="text-align:center;">\r\n	<span style="font-size:16px;background-color:#FFFFFF;color:#333333;font-family:tahoma, arial, 宋体, sans-serif;"> 因新功能上线<img src="http://localhost/sse/lib/zui/lib/kindeditor/plugins/emoticons/images/69.gif" alt="" border="0" />，获取单个订单接口，把订单ID（orderId）错误的读取成了仓库ID导致数据错误订单ID无法返回，系统已经在10点40左右修复上线，现重新获取订单即可获取正确的数据<img src="http://localhost/sse/lib/zui/lib/kindeditor/plugins/emoticons/images/83.gif" alt="" border="0" /> 。</span> \r\n</div>\r\n<p style="text-indent:2em;">\r\n	<span style="color:#333333;font-family:tahoma, arial, 宋体, sans-serif;background-color:#FFFFFF;font-size:16px;"> </span> \r\n</p>\r\n<div style="text-align:center;">\r\n	由此给您带来不便，敬请谅解。\r\n</div>\r\n<p>\r\n	<br />\r\n</p>\r\n<div style="text-align:right;">\r\n	<span style="background-color:#FFFFFF;color:#333333;font-family:tahoma, arial, 宋体, sans-serif;font-size:18px;"><strong></strong>感谢您对京东的关注与支持<img src="http://localhost/sse/lib/zui/lib/kindeditor/plugins/emoticons/images/79.gif" alt="" border="0" />！</span> \r\n</div>', '2017-10-24 14:36:16', '2017-10-30 11:13:17');
